import java.io.*;
import java.util.*;

class P{
	long x, y;
	public P(int x, int y) {
		super();
		this.x = x;
		this.y = y;
	}
}

public class Main {
	static InputStream is;
	static PrintWriter out;
	static String INPUT = "";

	static final long mod = (long) 1e9 + 7;
	static final int dx[] = { -1, 0, 1, 0 }, dy[] = { 0, -1, 0, 1 };
	static final int[] dx8 = { -1, -1, -1, 0, 0, 1, 1, 1 }, dy8 = { -1, 0, 1, -1, 1, -1, 0, 1 };
	static final int inf = Integer.MAX_VALUE / 3;
	static final long linf = Long.MAX_VALUE / 3;
	static final double dinf = Double.MAX_VALUE / 3;
	static final double eps = 1e-10;
	static final double pi = Math.PI;

	static void solve() {
		int n = ni();
		P p[] = new P[n];
		for(int i=0;i<n;i++) {
			p[i] = new P(ni(),ni());
		}
		int check = (int)Math.abs(p[0].x-p[0].y)%2;
		for(int i=0;i<n;i++) {
			if(check != Math.abs(p[i].x - p[i].y)%2) {
				out.println(-1);
				return;
			}
		}

		int m = 0;
		long d[];
		if(check==1) {
			m = 33;
			d = new long[m];
			for(int i=0;i<m;i++) {
				d[i] = 1L<<i;
			}
		}
		else {
			m = 34;
			d = new long[m];
			for(int i=0;i<m-1;i++) {
				d[i+1] = 1L<<i;
				d[0] = 1;
			}
		}

		out.println(m);
		for(int i=0;i<m;i++) {
			out.print(d[m-1-i] + " ");
		}
		out.println();

		for(int i=0;i=0;j--) {
				if(abs(x)-abs(y)>0) {
					if(x<0) {
						s += "L";
						x += d[j];
					}
					else {
						s += "R";
						x -= d[j];
					}
				}
				else {
					if(y<0) {
						s += "D";
						y += d[j];
					}
					else {
						s += "U";
						y -= d[j];
					}
				}
			}
			out.println(s);
		}

	}

	static int abs(int x) {
		return Math.abs(x);
	}
	static long abs(long x) {
		return Math.abs(x);
	}
	static double abs(double x) {
		return Math.abs(x);
	}

	static int lowerBound(int[] a, int x) {
		int l = -1, r = a.length;
		while (r - l > 1) {
			int c = (l + r) / 2;
			if (a[c] < x) {
				l = c;
			} else {
				r = c;
			}
		}
		return r;
	}

	static int upperBound(int[] a, int x) {
		int l = -1, r = a.length;
		while (r - l > 1) {
			int c = (l + r) / 2;
			if (a[c] <= x) {
				l = c;
			} else {
				r = c;
			}
		}
		return r;
	}

