		int n = sc.nextInt();

		int[] d = new int[n];

		for(int i = 0;i < n; i++) {
			d[i] = sc.nextInt();
		}
		int ans =0;
		for(int i = 0; i < n; i++) {
			for(int j = i + 1; j < n; j ++){
				ans += d[i] * d[j];
