        int A = sc.nextInt();
        int B = sc.nextInt();
        int C = sc.nextInt();

        if ((A == B && B != C) || (A == C && B != A) || (B == C && A != B)) {
            System.out.println("Yes");
        } else {
            System.out.println("No");
        }
    }
}

