import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        while (true) {
            int n = sc.nextInt();
            if (n == 0) break;
            int cnt = 0;
            for (int i = 5; n / i > 0; i *= 5) {
                cnt += n / i;
            }
            System.out.println(cnt);
        }
    }
}

