import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);

        while (sc.hasNext()) {
            int a = sc.nextInt();
            int b = sc.nextInt();
            int n = sc.nextInt();
            int s = 0;
            int rem = a % b;
            for (int i = 0; i < n; i++) {
                rem *= 10;
                int digit = rem / b;
                s += digit;
                rem = rem % b;
            }
            System.out.println(s);
        }
    }
}

