import java.util.*;

public class RankChecker {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        Map teamScores = new HashMap<>();
        Set scoreSet = new HashSet<>();

        while (true) {
            String line = sc.nextLine().trim();
            if (line.equals("")) continue;
            String[] parts = line.split(",");
            int p = Integer.parseInt(parts[0]);
            int s = Integer.parseInt(parts[1]);
            if (p == 0 && s == 0) break;
            teamScores.put(p, s);
            scoreSet.add(s);
        }

        List sortedScores = new ArrayList<>(scoreSet);
        sortedScores.sort(Collections.reverseOrder());
        Map scoreToRank = new HashMap<>();
        for (int i = 0; i < sortedScores.size(); i++) {
            scoreToRank.put(sortedScores.get(i), i + 1);
        }

        while (sc.hasNextLine()) {
            String qLine = sc.nextLine().trim();
            if (qLine.equals("")) continue;
            int queryTeam = Integer.parseInt(qLine);
            int teamScore = teamScores.get(queryTeam);
            System.out.println(scoreToRank.get(teamScore));
        }
    }
}

import java.util.*;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);

        Map teamScores = new HashMap<>();
        Set scoreSet = new HashSet<>();

        while (true) {
            String line = sc.nextLine().trim();
            if (line.equals("")) continue;
            String[] parts = line.split(",");
            int p = Integer.parseInt(parts[0]);
            int s = Integer.parseInt(parts[1]);
            if (p == 0 && s == 0) break;
            teamScores.put(p, s);
            scoreSet.add(s);
        }

        List sortedScores = new ArrayList<>(scoreSet);
        sortedScores.sort(Collections.reverseOrder());
        Map scoreToRank = new HashMap<>();
        for (int i = 0; i < sortedScores.size(); i++) {
            scoreToRank.put(sortedScores.get(i), i + 1);
        }

        while (sc.hasNextLine()) {
            String qLine = sc.nextLine().trim();
            if (qLine.equals("")) continue;
            int q = Integer.parseInt(qLine);
            int score = teamScores.get(q);
            System.out.println(scoreToRank.get(score));
        }
    }
}

import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int count = 0;
        while (sc.hasNextLine()) {
            String s = sc.nextLine();
            if (isPalindrome(s)) {
                count++;
            }
        }
        System.out.println(count);
    }

    private static boolean isPalindrome(String s) {
        int n = s.length();
        for (int i = 0; i < n / 2; i++) {
            if (s.charAt(i) != s.charAt(n - 1 - i)) {
                return false;
            }
        }
        return true;
    }
}

import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int palindromeCount = 0;
        while (sc.hasNextLine()) {
            String line = sc.nextLine();
            if (isPalindrome(line)) {
                palindromeCount++;
            }
        }
        System.out.println(palindromeCount);
    }

    private static boolean isPalindrome(String s) {
        int n = s.length();
        for (int i = 0; i < n / 2; i++) {
            if (s.charAt(i) != s.charAt(n - 1 - i)) {
                return false;
            }
        }
        return true;
    }
}

import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int n = sc.nextInt();
        int winnerNum = 0;
        int winnerFish = -1;
        for (int i = 0; i < n; i++) {
            int num = sc.nextInt();
            int fish = sc.nextInt();
            if (fish > winnerFish || (fish == winnerFish && num < winnerNum)) {
                winnerFish = fish;
                winnerNum = num;
            }
        }
        System.out.println(winnerNum + " " + winnerFish);
    }
}

