import java.util.*;

public class SaleResult {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);

        while (true) {
            int n = sc.nextInt();
            if (n == 0) break;

            LinkedHashMap sales = new LinkedHashMap<>();

            for (int j = 0; j < n; j++) {
                int id = sc.nextInt();
                int p = sc.nextInt();
                int q = sc.nextInt();
                long amount = (long) p * q;
                sales.put(id, sales.getOrDefault(id, 0L) + amount);
            }

            boolean found = false;
            for (Map.Entry entry : sales.entrySet()) {
                if (entry.getValue() >= 1_000_000L) {
                    System.out.println(entry.getKey());
                    found = true;
                }
            }
            if (!found) {
                System.out.println("NA");
            }
        }
        sc.close();
    }
}

import java.util.*;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);

        while (true) {
