            boolean found = false;
            for (Map.Entry entry : sales.entrySet()) {
                if (entry.getValue() >= 1000000) {
                    System.out.println(entry.getKey());
                    found = true;
                }
            }

            if (!found) {
                System.out.println("NA");
            }
        }

        sc.close();
    }
}

