import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);

        while (true) {
            if (!sc.hasNext()) break;
            int n = sc.nextInt();
            if (n == 0) break;
            int[] count = new int[10];
            for (int i = 0; i < n; i++) {
                int t = sc.nextInt();
                count[t]++;
            }
            for (int i = 0; i < 10; i++) {
                if (count[i] == 0) {
                    System.out.println("-");
                } else {
                    for (int j = 0; j < count[i]; j++) {
                        System.out.print("*");
                    }
                    System.out.println();
                }
            }
        }
    }
}

