import java.util.*;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        while (true) {
            int n = sc.nextInt();
            int k = sc.nextInt();
            if (n == 0 && k == 0) break;
            int[] a = new int[n];
            for (int i = 0; i < n; i++) a[i] = sc.nextInt();

            int sum = 0;
            for (int i = 0; i < k; i++) sum += a[i];
            int max = sum;

            for (int i = k; i < n; i++) {
                sum += a[i] - a[i - k];
                if (sum > max) max = sum;
            }
            System.out.println(max);
        }
    }
}

import java.util.*;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);

        while (true) {
            int n = sc.nextInt();
            int k = sc.nextInt();
            if (n == 0 && k == 0) break;

            int[] a = new int[n];
            for (int i = 0; i < n; i++) a[i] = sc.nextInt();

            int sum = 0;
            for (int i = 0; i < k; i++) sum += a[i];

            int maxSum = sum;
            for (int i = k; i < n; i++) {
                sum += a[i] - a[i - k];
                if (sum > maxSum) maxSum = sum;
            }
            System.out.println(maxSum);
        }
    }
}

