import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);

        for(int i = 0; i < 3; i++) {
            int sh = sc.nextInt();
            int sm = sc.nextInt();
            int ss = sc.nextInt();
            int eh = sc.nextInt();
            int em = sc.nextInt();
            int es = sc.nextInt();

            int startSec = sh * 3600 + sm * 60 + ss;
            int endSec = eh * 3600 + em * 60 + es;
            int diff = endSec - startSec;

            int h = diff / 3600;
            diff %= 3600;
            int m = diff / 60;
            int s = diff % 60;

            System.out.println(h + " " + m + " " + s);
        }
    }
}

