import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int caseNum = 1;
        while (true) {
            int N = sc.nextInt();
            if (N == 0) break;
            int[][] mat = new int[N][N];
            int cnt = 1;
            for (int s = 0; s <= 2 * (N - 1); s++) {
                if (s % 2 == 0) {
                    for (int i = 0; i <= s; i++) {
                        int x = i;
                        int y = s - i;
                        if (x < N && y < N) {
                            mat[x][y] = cnt++;
                        }
                    }
                } else {
                    for (int i = 0; i <= s; i++) {
                        int x = s - i;
                        int y = i;
                        if (x < N && y < N) {
                            mat[x][y] = cnt++;
                        }
                    }
                }
            }
            System.out.println("Case " + caseNum + ":");
            for (int i = 0; i < N; i++) {
                for (int j = 0; j < N; j++) {
                    System.out.printf("%3d", mat[i][j]);
                }
                System.out.println();
            }
            caseNum++;
        }
    }
}

