import java.util.*;

public class Main {
    static class Edge {
        int to, cost;
        Edge(int to, int cost) {
            this.to = to;
            this.cost = cost;
        }
    }

    static class Node implements Comparable {
        int v, dist;
        Node(int v, int dist) {
            this.v = v;
            this.dist = dist;
        }
        public int compareTo(Node o) {
            return Integer.compare(this.dist, o.dist);
        }
    }

    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int n = sc.nextInt();
        List[] graph = new ArrayList[n];
        for (int i = 0; i < n; i++) graph[i] = new ArrayList<>();
        for (int i = 0; i < n; i++) {
            int u = sc.nextInt();
            int k = sc.nextInt();
            for (int j = 0; j < k; j++) {
                int v = sc.nextInt();
                int c = sc.nextInt();
                graph[u].add(new Edge(v, c));
            }
        }

        int[] dist = new int[n];
        Arrays.fill(dist, Integer.MAX_VALUE);
        dist[0] = 0;
        PriorityQueue pq = new PriorityQueue<>();
        pq.offer(new Node(0, 0));

        while (!pq.isEmpty()) {
            Node cur = pq.poll();
            if (cur.dist > dist[cur.v]) continue;
            for (Edge e : graph[cur.v]) {
                if (dist[e.to] > dist[cur.v] + e.cost) {
                    dist[e.to] = dist[cur.v] + e.cost;
                    pq.offer(new Node(e.to, dist[e.to]));
                }
            }
        }

        for (int i = 0; i < n; i++) {
            System.out.println(i + " " + dist[i]);
        }
    }
}

import java.util.*;

public class Main {
    static class Edge {
        int to, cost;
        Edge(int to, int cost) {
            this.to = to;
            this.cost = cost;
        }
    }

    static class Node implements Comparable {
        int id, dist;
        Node(int id, int dist) {
            this.id = id;
            this.dist = dist;
        }
        public int compareTo(Node o) {
            return Integer.compare(this.dist, o.dist);
        }
    }

    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int n = sc.nextInt();
        List[] adj = new ArrayList[n];
        for (int i = 0; i < n; i++) adj[i] = new ArrayList<>();

        for (int i = 0; i < n; i++) {
            int u = sc.nextInt();
            int k = sc.nextInt();
            for (int j = 0; j < k; j++) {
                int v = sc.nextInt();
                int c = sc.nextInt();
                adj[u].add(new Edge(v, c));
            }
        }

        int[] dist = new int[n];
        Arrays.fill(dist, Integer.MAX_VALUE);
        dist[0] = 0;
        PriorityQueue pq = new PriorityQueue<>();
        pq.offer(new Node(0, 0));

        while (!pq.isEmpty()) {
            Node curr = pq.poll();
            if (curr.dist > dist[curr.id]) continue;
            for (Edge e : adj[curr.id]) {
                if (dist[e.to] > dist[curr.id] + e.cost) {
                    dist[e.to] = dist[curr.id] + e.cost;
                    pq.offer(new Node(e.to, dist[e.to]));
                }
            }
        }

        for (int i = 0; i < n; i++) {
            System.out.println(i + " " + dist[i]);
        }
    }
}

import java.io.*;
import java.util.*;

public class Main {
    static int cnt = 0;
    static ArrayList G = new ArrayList<>();

    static void insertionSort(int[] A, int n, int g) {
        for (int i = g; i < n; i++) {
            int v = A[i];
            int j = i - g;
            while (j >= 0 && A[j] > v) {
                A[j + g] = A[j];
                j = j - g;
                cnt++;
            }
            A[j + g] = v;
        }
    }

    static void shellSort(int[] A, int n) {
        G.clear();
        for (int h = 1; h <= n; ) {
            G.add(h);
            h = 3 * h + 1;
        }
        Collections.reverse(G);
        for (int i = 0; i < G.size(); i++) {
            insertionSort(A, n, G.get(i));
        }
    }

    public static void main(String[] args) throws IOException {
        BufferedReader br = new BufferedReader(new InputStreamReader(System.in));
        int n = Integer.parseInt(br.readLine());
        int[] A = new int[n];
        for (int i = 0; i < n; i++) {
            A[i] = Integer.parseInt(br.readLine());
        }
        shellSort(A, n);

        System.out.println(G.size());
        for (int i = 0; i < G.size(); i++) {
            System.out.print(G.get(i));
            if (i != G.size() - 1) System.out.print(" ");
        }
        System.out.println();
        System.out.println(cnt);
        for (int i = 0; i < n; i++) {
            System.out.println(A[i]);
        }
    }
}

