import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);

        int N = sc.nextInt();
        int K = sc.nextInt();
        boolean[] hasSnack = new boolean[N + 1];

        for (int i = 0; i < K; i++) {
            int d = sc.nextInt();
            for (int j = 0; j < d; j++) {
                int snuke = sc.nextInt();
                hasSnack[snuke] = true;
            }
        }

        int count = 0;
        for (int i = 1; i <= N; i++) {
            if (!hasSnack[i]) count++;
        }
        System.out.println(count);
    }
}

