public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        long N = sc.nextLong();
        long A = sc.nextLong();
        long B = sc.nextLong();

        long cycle = A + B;
        long fullCycles = N / cycle;
        long rem = N % cycle;

        long blue = fullCycles * A + Math.min(rem, A);

        System.out.println(blue);
    }
}

