public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        long N = sc.nextLong();
        long A = sc.nextLong();
        long B = sc.nextLong();

        if (A == 0) {
            System.out.println(0);
            return;
        }

        long cycle = A + B;
        long fullCycles = N / cycle;
        long rem = N % cycle;

        long answer = fullCycles * A + Math.min(A, rem);
        System.out.println(answer);
    }
}

