import java.util.*;
public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int n = sc.nextInt();
        HashSet set = new HashSet<>();
        for (int i = 0; i < n; i++) {
            int a = sc.nextInt();
            if (!set.add(a)) {
                System.out.println("NO");
                return;
            }
        }
        System.out.println("YES");
    }
}

