    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int A = sc.nextInt();
        int B = sc.nextInt();

        int sum = A + B;
        int diff = A - B;
        int product = A * B;

        int max = Math.max(sum, Math.max(diff, product));
        System.out.println(max);
    }
}

