import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        long L = sc.nextLong();
        long R = sc.nextLong();
        int MOD = 2019;
        if (R - L >= MOD) {
            System.out.println(0);
            return;
        }
        int min = MOD;
        for (long i = L; i < R; i++) {
            for (long j = i + 1; j <= R; j++) {
                int val = (int)((i % MOD) * (j % MOD) % MOD);
                if (val < min) min = val;
            }
        }
        System.out.println(min);
    }
}

