import java.util.*;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int N = sc.nextInt();
        int M = sc.nextInt();

        int[] bulbSwitchMask = new int[M];
        for (int i = 0; i < M; i++) {
            int k = sc.nextInt();
            int mask = 0;
            for (int j = 0; j < k; j++) {
                int s = sc.nextInt() - 1;
                mask |= (1 << s);
            }
            bulbSwitchMask[i] = mask;
        }

        int[] p = new int[M];
        for (int i = 0; i < M; i++) {
            p[i] = sc.nextInt();
        }

        int ans = 0;
        for (int sw = 0; sw < (1 << N); sw++) {
            boolean allOn = true;
            for (int i = 0; i < M; i++) {
                int cnt = Integer.bitCount(sw & bulbSwitchMask[i]);
                if (cnt % 2 != p[i]) {
                    allOn = false;
                    break;
                }
            }
            if (allOn) ans++;
        }
        System.out.println(ans);
    }
}

import java.util.*;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);

        int N = sc.nextInt();
        int M = sc.nextInt();

        int[] bulbsMasks = new int[M];
        for (int i = 0; i < M; i++) {
            int k = sc.nextInt();
            int mask = 0;
            for (int j = 0; j < k; j++) {
                int s = sc.nextInt() - 1;
                mask |= (1 << s);
            }
            bulbsMasks[i] = mask;
        }
        int[] p = new int[M];
        for (int i = 0; i < M; i++) {
            p[i] = sc.nextInt();
        }

        int res = 0;
        for (int state = 0; state < (1 << N); state++) {
            boolean ok = true;
            for (int i = 0; i < M; i++) {
                int onCount = Integer.bitCount(state & bulbsMasks[i]);
                if (onCount % 2 != p[i]) {
                    ok = false;
                    break;
                }
            }
            if (ok) res++;
        }
        System.out.println(res);
    }
}

import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);

        int N = sc.nextInt();
        int M = sc.nextInt();

        int maxL = 1;
        int minR = N;

        for (int i = 0; i < M; i++) {
            int L = sc.nextInt();
            int R = sc.nextInt();
            if (L > maxL) maxL = L;
            if (R < minR) minR = R;
        }

        int ans = minR - maxL + 1;
        if (ans < 0) ans = 0;
        System.out.println(ans);
    }
}

import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);

        int N = sc.nextInt();
        int M = sc.nextInt();
        int left = 1;
        int right = N;

        for (int i = 0; i < M; i++) {
            int L = sc.nextInt();
            int R = sc.nextInt();
            if (L > left) left = L;
            if (R < right) right = R;
        }

        int ans = right - left + 1;
        if (ans < 0) ans = 0;
        System.out.println(ans);
    }
}

