import java.util.Scanner;

public class OceanViewInns {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int N = sc.nextInt();
        int[] H = new int[N];
        for (int i = 0; i < N; i++) {
            H[i] = sc.nextInt();
        }

        int count = 0;
        int maxSoFar = Integer.MIN_VALUE;
        for (int i = 0; i < N; i++) {
            if (H[i] >= maxSoFar) {
                count++;
                maxSoFar = H[i];
            }
        }
        System.out.println(count);
    }
}

