import java.util.*;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);

        int N = sc.nextInt();
        List b = new ArrayList<>();
        for (int i = 0; i < N; i++) {
            b.add(sc.nextInt());
        }

        List ops = new ArrayList<>();

        for (int i = 0; i < N; i++) {
            boolean found = false;
            for (int j = b.size() - 1; j >= 0; j--) {
                if (b.get(j) == j + 1) {
                    ops.add(j + 1);
                    b.remove(j);
                    found = true;
                    break;
                }
            }
            if (!found) {
                System.out.println(-1);
                return;
            }
        }

        Collections.reverse(ops);
        for (int op : ops) {
            System.out.println(op);
        }
    }
}

import java.util.*;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int N = sc.nextInt();
        LinkedList b = new LinkedList<>();
        for (int i = 0; i < N; i++) {
            b.add(sc.nextInt());
        }

        ArrayList ops = new ArrayList<>();

        for (int i = 0; i < N; i++) {
            boolean found = false;
            for (int j = b.size() - 1; j >= 0; j--) {
                if (b.get(j) == j + 1) {
                    ops.add(j + 1);
                    b.remove(j);
                    found = true;
                    break;
                }
            }
            if (!found) {
                System.out.println(-1);
                return;
            }
        }

        Collections.reverse(ops);
        for (int op : ops) {
            System.out.println(op);
        }
    }
}

