import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);

        int N = sc.nextInt();
        int[] a = new int[N];
        int sum = 0;
        for (int i = 0; i < N; i++) {
            a[i] = sc.nextInt();
            sum += a[i];
        }

        double avg = (double) sum / N;
        double minDiff = Double.MAX_VALUE;
        int idx = -1;

        for (int i = 0; i < N; i++) {
            double diff = Math.abs(a[i] - avg);
            if (diff < minDiff) {
                minDiff = diff;
                idx = i;
            }
        }

        System.out.println(idx);
    }
}

