public class Palace {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int N = sc.nextInt();
        int T = sc.nextInt();
        int A = sc.nextInt();
        int[] H = new int[N];

        for (int i = 0; i < N; i++) {
            H[i] = sc.nextInt();
        }

        int bestIndex = 0;
        double minDiff = Double.MAX_VALUE;

        for (int i = 0; i < N; i++) {
            double temp = T - H[i] * 0.006;
