import java.util.*;
public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int N = sc.nextInt();
        int K = sc.nextInt();
        int[] x = new int[N];
        for (int i = 0; i < N; i++) x[i] = sc.nextInt();

        int minTime = Integer.MAX_VALUE;
        for (int i = 0; i + K - 1 < N; i++) {
            int left = x[i];
            int right = x[i + K - 1];
            int time1 = Math.abs(0 - left) + (right - left);
            int time2 = Math.abs(0 - right) + (right - left);
            minTime = Math.min(minTime, Math.min(time1, time2));
        }
        System.out.println(minTime);
    }
}

import java.util.*;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int N = sc.nextInt();
        int K = sc.nextInt();
        int[] x = new int[N];
        for (int i = 0; i < N; i++) x[i] = sc.nextInt();

        int minTime = Integer.MAX_VALUE;
        for (int i = 0; i + K - 1 < N; i++) {
            int left = x[i];
            int right = x[i + K - 1];
            int toLeftFirst = Math.abs(0 - left) + (right - left);
            int toRightFirst = Math.abs(0 - right) + (right - left);
            minTime = Math.min(minTime, Math.min(toLeftFirst, toRightFirst));
        }
        System.out.println(minTime);
    }
}

import java.util.Scanner;

public class Main {
    static long gcd(long a, long b) {
        while (b != 0) {
            long t = b;
            b = a % b;
            a = t;
        }
        return a;
    }

    static long lcm(long a, long b) {
        return a / gcd(a, b) * b;
    }

    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        long N = sc.nextLong();
        System.out.println(lcm(2, N));
    }
}

