import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int N = sc.nextInt();
        int[] A = new int[N];
        for(int i = 0; i < N; i++) {
            A[i] = sc.nextInt();
        }

        long ans = 0;
        int right = 0;
        int xor = 0, sum = 0;

        for(int left = 0; left < N; left++) {
            while(right < N && (xor ^ A[right]) == (sum + A[right])) {
                xor ^= A[right];
                sum += A[right];
                right++;
            }
            ans += right - left;
            xor ^= A[left];
            sum -= A[left];
        }
        System.out.println(ans);
    }
}

