import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);

        int n = sc.nextInt();
        int[] A = new int[n];
        for (int i = 0; i < n; i++) {
            A[i] = sc.nextInt();
        }

        long count = 0;
        int r = 0;
        int xor = 0, sum = 0;

        for (int l = 0; l < n; l++) {
            while (r < n && (xor ^ A[r]) == (sum + A[r])) {
                xor ^= A[r];
                sum += A[r];
                r++;
            }
            count += r - l;
            xor ^= A[l];
            sum -= A[l];
        }

        System.out.println(count);
    }
}

