import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int A = sc.nextInt();
        int B = sc.nextInt();
        int count = 0;

        for (int a = 1; a <= 9; a++) {
            for (int b = 0; b <= 9; b++) {
                for (int c = 0; c <= 9; c++) {
                    int palindrome = a * 10000 + b * 1000 + c * 100 + b * 10 + a;
                    if (palindrome >= A && palindrome <= B) {
                        count++;
                    }
                }
            }
        }

        System.out.println(count);
    }
}

