        for (int i = 0; i < N; i++) {
            int a = sc.nextInt();
            freq.put(a, freq.getOrDefault(a, 0) + 1);
        }
        int ans = 0;
        for (Map.Entry entry : freq.entrySet()) {
            int x = entry.getKey();
            int cnt = entry.getValue();
            if (cnt == x) continue;
            else if (cnt > x) ans += cnt - x;
            else ans += cnt;
        }
        System.out.println(ans);
    }
}

