import java.util.*;
public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int N = sc.nextInt();
        int K = sc.nextInt();
        int[] A = new int[N];
        for(int i = 0; i < N; i++) A[i] = sc.nextInt();

        HashMap freq = new HashMap<>();
        for (int x : A) freq.put(x, freq.getOrDefault(x, 0) + 1);

        if (freq.size() <= K) {
            System.out.println(0);
            return;
        }

        ArrayList counts = new ArrayList<>(freq.values());
        Collections.sort(counts);

        int rewrite = 0;
        for (int i = 0; i < counts.size() - K; i++) {
            rewrite += counts.get(i);
        }
        System.out.println(rewrite);
    }
}

import java.util.*;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int N = sc.nextInt();
        int K = sc.nextInt();
        int[] A = new int[N];
        for (int i = 0; i < N; i++) A[i] = sc.nextInt();

        Map freq = new HashMap<>();
        for (int x : A) freq.put(x, freq.getOrDefault(x, 0) + 1);

        if (freq.size() <= K) {
            System.out.println(0);
            return;
        }

        List freqList = new ArrayList<>(freq.values());
        Collections.sort(freqList);

        int rewrite = 0;
        for (int i = 0; i < freqList.size() - K; i++) {
            rewrite += freqList.get(i);
        }
        System.out.println(rewrite);
    }
}

