import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        String s = sc.next();
        int A = s.charAt(0) - '0';
        int B = s.charAt(1) - '0';
        int C = s.charAt(2) - '0';
        int D = s.charAt(3) - '0';

        for (int i = 0; i < 8; i++) {
            int res = A;
            char[] ops = new char[3];
            if ((i & 4) == 0) {
                res += B;
                ops[0] = '+';
            } else {
                res -= B;
                ops[0] = '-';
            }
            if ((i & 2) == 0) {
                res += C;
                ops[1] = '+';
            } else {
                res -= C;
                ops[1] = '-';
            }
            if ((i & 1) == 0) {
                res += D;
                ops[2] = '+';
            } else {
                res -= D;
                ops[2] = '-';
            }
            if (res == 7) {
                System.out.printf("%d%c%d%c%d%c%d=7\n", A, ops[0], B, ops[1], C, ops[2], D);
                break;
            }
        }
    }
}

import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        String s = sc.next();

        int A = s.charAt(0) - '0';
        int B = s.charAt(1) - '0';
        int C = s.charAt(2) - '0';
        int D = s.charAt(3) - '0';

        for (int i = 0; i < 8; i++) {
            int sum = A;
            char[] ops = new char[3];
            if ((i & 4) == 0) { sum += B; ops[0] = '+'; } else { sum -= B; ops[0] = '-'; }
            if ((i & 2) == 0) { sum += C; ops[1] = '+'; } else { sum -= C; ops[1] = '-'; }
            if ((i & 1) == 0) { sum += D; ops[2] = '+'; } else { sum -= D; ops[2] = '-'; }
            if (sum == 7) {
                System.out.printf("%d%c%d%c%d%c%d=7\n", A, ops[0], B, ops[1], C, ops[2], D);
                break;
            }
        }
    }
}

import java.util.Scanner;

public class HexLetterCompare {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        String X = sc.next();
        String Y = sc.next();
        int x = Integer.parseInt(X, 16);
        int y = Integer.parseInt(Y, 16);

        if (x < y) {
            System.out.println("<");
        } else if (x > y) {
            System.out.println(">");
        } else {
            System.out.println("=");
        }
    }
}

