import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);

        int N = sc.nextInt();
        long A = sc.nextLong();
        long B = sc.nextLong();

        long[] X = new long[N];
        for (int i = 0; i < N; i++) {
            X[i] = sc.nextLong();
        }

        long totalFatigue = 0;
        for (int i = 1; i < N; i++) {
            long walkCost = (X[i] - X[i - 1]) * A;
            totalFatigue += Math.min(walkCost, B);
        }
        System.out.println(totalFatigue);
    }
}

