import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);

        int N = sc.nextInt();
        int[] T = new int[N];
        int total = 0;
        for (int i = 0; i < N; i++) {
            T[i] = sc.nextInt();
            total += T[i];
        }

        int M = sc.nextInt();
        for (int i = 0; i < M; i++) {
            int P = sc.nextInt();
            int X = sc.nextInt();
            int newTotal = total - T[P-1] + X;
            System.out.println(newTotal);
        }
    }
}

import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);

        int N = sc.nextInt();
        int[] T = new int[N];
        int baseSum = 0;
        for (int i = 0; i < N; i++) {
            T[i] = sc.nextInt();
            baseSum += T[i];
        }

        int M = sc.nextInt();
        for (int i = 0; i < M; i++) {
            int P = sc.nextInt();
            int X = sc.nextInt();
            int total = baseSum - T[P - 1] + X;
            System.out.println(total);
        }
    }
}

