import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        String s = sc.next();
        int N = s.length();

        int atRock = 0;
        int atPaper = 0;
        int score = 0;

        for (int i = 0; i < N; i++) {
            char opp = s.charAt(i);
            if (opp == 'g') {
                if (atPaper + 1 <= atRock) {
                    atPaper++;
                    score++;
                } else {
                    atRock++;
                }
            } else {
                atRock++;
                score--;
            }
        }

        System.out.println(score);
    }
}

