import java.util.*;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);

        int N = sc.nextInt();
        long[] A = new long[N + 2];

        for (int i = 1; i <= N; i++) {
            A[i] = sc.nextLong();
        }

        long pairs = 0;

        for (int i = 1; i <= N; i++) {
            long pairPrev = Math.min(A[i-1], A[i]);
            pairs += pairPrev;
            A[i-1] -= pairPrev;
            A[i] -= pairPrev;

            long pairNext = Math.min(A[i], A[i+1]);
            pairs += pairNext;
            A[i] -= pairNext;
            A[i+1] -= pairNext;
        }

        System.out.println(pairs);
    }
}

import java.util.*;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int N = sc.nextInt();
        long[] A = new long[N + 2];

        for (int i = 1; i <= N; i++) {
            A[i] = sc.nextLong();
        }

        long res = 0;
        for (int i = 1; i <= N; i++) {
            long pair1 = Math.min(A[i - 1], A[i]);
            res += pair1;
            A[i - 1] -= pair1;
            A[i] -= pair1;
            long pair2 = Math.min(A[i], A[i + 1]);
            res += pair2;
            A[i] -= pair2;
            A[i + 1] -= pair2;
        }
        System.out.println(res);
    }
}

import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        String s = sc.next();
        int n = s.length();

        for (int i = 0; i < n - 1; i++) {
            if (s.charAt(i) == s.charAt(i + 1)) {
                System.out.println((i + 1) + " " + (i + 2));
                return;
            }
        }

        for (int i = 0; i < n - 2; i++) {
            char a = s.charAt(i), b = s.charAt(i + 1), c = s.charAt(i + 2);
            if (a == b || b == c || a == c) {
                System.out.println((i + 1) + " " + (i + 3));
                return;
            }
        }

        System.out.println("-1 -1");
    }
}

