import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);

        while (sc.hasNext()) {
            long a = sc.nextLong();
            long b = sc.nextLong();

            long gcd = gcd(a, b);
            long lcm = (a / gcd) * b;

            System.out.println(gcd + " " + lcm);
        }

        sc.close();
    }

    private static long gcd(long a, long b) {
        while (b != 0) {
            long temp = b;
            b = a % b;
            a = temp;
        }
        return a;
    }
}

