import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int n = sc.nextInt();

        int maxFish = -1;
        int winnerId = Integer.MAX_VALUE;

        for (int i = 0; i < n; i++) {
            int id = sc.nextInt();
            int fish = sc.nextInt();

            if (fish > maxFish || (fish == maxFish && id < winnerId)) {
                maxFish = fish;
                winnerId = id;
            }
        }

        System.out.println(winnerId + " " + maxFish);
        sc.close();
    }
}

