import java.util.*;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);

        int n = sc.nextInt();
        Map<Integer, List> graph = new HashMap<>();

        for (int i = 0; i < n; i++) {
            int router = sc.nextInt();
            int k = sc.nextInt();
            List connections = new ArrayList<>();
            for (int j = 0; j < k; j++) {
                connections.add(sc.nextInt());
            }
            graph.put(router, connections);
        }

        int p = sc.nextInt();
        for (int i = 0; i < p; i++) {
            int source = sc.nextInt();
            int dest = sc.nextInt();
            int ttl = sc.nextInt();

            int shortestPath = findShortestPath(graph, source, dest);

            if (shortestPath == -1 || ttl < shortestPath - 1) {
                System.out.println("NA");
            } else {
                System.out.println(shortestPath);
            }
        }

        sc.close();
    }

    private static int findShortestPath(Map<Integer, List> graph, int source, int dest) {
        Queue queue = new LinkedList<>();
        Map distance = new HashMap<>();

        queue.offer(source);
        distance.put(source, 1);

        while (!queue.isEmpty()) {
            int current = queue.poll();

            if (current == dest) {
                return distance.get(current);
            }

            List neighbors = graph.get(current);
            if (neighbors != null) {
                for (int neighbor : neighbors) {
                    if (!distance.containsKey(neighbor)) {
                        distance.put(neighbor, distance.get(current) + 1);
                        queue.offer(neighbor);
                    }
                }
            }
        }

        return -1;
    }
}

import java.util.*;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);

        int n = sc.nextInt();
        Map<Integer, List> graph = new HashMap<>();

        for (int i = 0; i < n; i++) {
            int router = sc.nextInt();
            int k = sc.nextInt();
            List connections = new ArrayList<>();
            for (int j = 0; j < k; j++) {
                connections.add(sc.nextInt());
            }
            graph.put(router, connections);
        }

        int p = sc.nextInt();
        for (int i = 0; i < p; i++) {
            int source = sc.nextInt();
            int dest = sc.nextInt();
            int ttl = sc.nextInt();

            int minPath = findShortestPath(graph, source, dest);

            if (minPath == -1 || ttl < minPath - 1) {
                System.out.println("NA");
            } else {
                System.out.println(minPath);
            }
        }

        sc.close();
    }

    private static int findShortestPath(Map<Integer, List> graph, int source, int dest) {
        Queue queue = new LinkedList<>();
        Map distances = new HashMap<>();

        queue.offer(source);
        distances.put(source, 1);

        while (!queue.isEmpty()) {
            int current = queue.poll();

            if (current == dest) {
                return distances.get(current);
            }

            List neighbors = graph.get(current);
            if (neighbors != null) {
                for (int neighbor : neighbors) {
                    if (!distances.containsKey(neighbor)) {
                        distances.put(neighbor, distances.get(current) + 1);
                        queue.offer(neighbor);
                    }
                }
            }
        }

        return -1;
    }
}

