import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);

        while (true) {
            int m = sc.nextInt();
            int n = sc.nextInt();

            if (m == 0 && n == 0) break;

            int[] w = new int[n];
            int maxWidth = 0;
            int totalWidth = 0;

            for (int i = 0; i < n; i++) {
                w[i] = sc.nextInt();
                maxWidth = Math.max(maxWidth, w[i]);
                totalWidth += w[i];
            }

            int left = maxWidth;
            int right = totalWidth;
            int answer = right;

            while (left <= right) {
                int mid = left + (right - left) / 2;

                if (canFit(w, m, mid)) {
                    answer = mid;
                    right = mid - 1;
                } else {
                    left = mid + 1;
                }
            }

            System.out.println(answer);
        }

        sc.close();
    }

    private static boolean canFit(int[] w, int m, int maxWidth) {
        int shelves = 1;
        int currentWidth = 0;

        for (int i = 0; i < w.length; i++) {
            if (currentWidth + w[i] <= maxWidth) {
                currentWidth += w[i];
            } else {
                shelves++;
                currentWidth = w[i];
                if (shelves > m) {
                    return false;
                }
            }
        }

        return true;
    }
}

