import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);

        while (true) {
            int n = sc.nextInt();
            if (n == 0) break;

            int[] counts = new int[7];

            for (int i = 0; i < n; i++) {
                int age = sc.nextInt();

                if (age < 10) {
                    counts[0]++;
                } else if (age < 20) {
                    counts[1]++;
                } else if (age < 30) {
                    counts[2]++;
                } else if (age < 40) {
                    counts[3]++;
                } else if (age < 50) {
                    counts[4]++;
                } else if (age < 60) {
                    counts[5]++;
                } else {
                    counts[6]++;
                }
            }

