import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner scanner = new Scanner(System.in);

        while (true) {
            int n = scanner.nextInt();
            if (n == 0) break;

            int[] count = new int[10];

            for (int i = 0; i < n; i++) {
                int type = scanner.nextInt();
                count[type]++;
            }

            for (int i = 0; i < 10; i++) {
                if (count[i] == 0) {
                    System.out.println("-");
                } else {
                    for (int j = 0; j < count[i]; j++) {
                        System.out.print("*");
                    }
                    System.out.println();
                }
            }
        }

        scanner.close();
    }
}

