import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);

        while (true) {
            int n = sc.nextInt();
            if (n == 0) break;

            int y = sc.nextInt();

            int bestBank = -1;
            double maxAmount = 0;

            for (int i = 0; i < n; i++) {
                int bankNum = sc.nextInt();
                int rate = sc.nextInt();
                int type = sc.nextInt();

                double amount;
                if (type == 1) {
                    amount = 1 + (rate / 100.0) * y;
                } else {
                    amount = Math.pow(1 + rate / 100.0, y);
                }

                if (amount > maxAmount) {
                    maxAmount = amount;
                    bestBank = bankNum;
                }
            }

            System.out.println(bestBank);
        }

        sc.close();
    }
}

