        int M = sc.nextInt();

        int[] A = new int[N];
        for (int i = 0; i < N; i++) {
            A[i] = sc.nextInt();
        }

        int[] votes = new int[N];

        for (int j = 0; j < M; j++) {
            int B = sc.nextInt();

            for (int i = 0; i < N; i++) {
                if (A[i] <= B) {
                    votes[i]++;
                    break;
                }
            }
        }

        int maxVotes = 0;
        int winnerSport = 1;
        for (int i = 0; i < N; i++) {
            if (votes[i] > maxVotes) {
                maxVotes = votes[i];
                winnerSport = i + 1;
            }
        }

        System.out.println(winnerSport);
        sc.close();
    }
