import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);

        int A = sc.nextInt();
        int B = sc.nextInt();
        int C = sc.nextInt();
        int D = sc.nextInt();
        int E = sc.nextInt();

        int totalTime = 0;

        if (A < 0) {
            totalTime += C * (0 - A);
            totalTime += D;
            totalTime += E * B;
        } else {
            totalTime += E * (B - A);
        }

        System.out.println(totalTime);
        sc.close();
    }
}

