            if (N == 0 && K == 0) {
                break;
            }

            int[] stock = new int[K];
            for (int i = 0; i < K; i++) {
                stock[i] = sc.nextInt();
            }

            int[][] needs = new int[N][K];
            for (int i = 0; i < N; i++) {
                for (int j = 0; j < K; j++) {
                    needs[i][j] = sc.nextInt();
                }
            }

            int[] totalNeeded = new int[K];
            for (int j = 0; j < K; j++) {
                for (int i = 0; i < N; i++) {
                    totalNeeded[j] += needs[i][j];
                }
            }

            boolean possible = true;
            for (int j = 0; j < K; j++) {
                if (totalNeeded[j] > stock[j]) {
                    possible = false;
                    break;
                }
            }

            System.out.println(possible ? "Yes" : "No");
        }

        sc.close();
    }
}

