import java.util.*;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);

        while (true) {
            int N = sc.nextInt();
            if (N == 0) break;

            int W = sc.nextInt();
            int H = sc.nextInt();

            boolean[][] field = new boolean[H + 1][W + 1];

            for (int i = 0; i < N; i++) {
                int x = sc.nextInt();
                int y = sc.nextInt();
                field[y][x] = true;
            }

            int S = sc.nextInt();
            int T = sc.nextInt();

            int maxTrees = 0;

            for (int startY = 1; startY <= H - T + 1; startY++) {
                for (int startX = 1; startX <= W - S + 1; startX++) {
                    int count = 0;

                    for (int y = startY; y < startY + T; y++) {
                        for (int x = startX; x < startX + S; x++) {
                            if (field[y][x]) {
                                count++;
                            }
                        }
                    }

                    maxTrees = Math.max(maxTrees, count);
                }
            }

            System.out.println(maxTrees);
        }

        sc.close();
    }
}

