import java.util.*;

public class Main {
    static class Record {
        int time, pc, student, status;
        Record(int t, int n, int m, int s) {
            time = t; pc = n; student = m; status = s;
        }
    }

    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);

        while (true) {
            int N = sc.nextInt();
            int M = sc.nextInt();
            if (N == 0 && M == 0) break;

            int r = sc.nextInt();
            List records = new ArrayList<>();
            for (int i = 0; i < r; i++) {
                int t = sc.nextInt();
                int n = sc.nextInt();
                int m = sc.nextInt();
                int s = sc.nextInt();
                records.add(new Record(t, n, m, s));
            }

            int q = sc.nextInt();
            for (int i = 0; i < q; i++) {
                int ts = sc.nextInt();
                int te = sc.nextInt();
                int m = sc.nextInt();

                System.out.println(calculateUsage(records, ts, te, m));
            }
        }
    }

    static int calculateUsage(List records, int ts, int te, int student) {
        Map loginTimes = new HashMap<>();
        int totalUsage = 0;

        for (Record rec : records) {
            if (rec.student != student) continue;

            if (rec.status == 1) {
                loginTimes.put(rec.pc, rec.time);
            } else {
                Integer loginTime = loginTimes.get(rec.pc);
                if (loginTime != null) {
                    int start = Math.max(loginTime, ts);
                    int end = Math.min(rec.time, te);
                    if (start < end) {
                        totalUsage += end - start;
                    }
                    loginTimes.remove(rec.pc);
                }
            }
        }

        for (Map.Entry entry : loginTimes.entrySet()) {
            int loginTime = entry.getValue();
            int start = Math.max(loginTime, ts);
            if (start < te) {
                totalUsage += te - start;
            }
        }

        return totalUsage;
    }
}

