import java.util.*;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);

        while (true) {
            int n = sc.nextInt();
            int m = sc.nextInt();

            if (n == 0 && m == 0) break;

            int[] taro = new int[n];
            int[] hanako = new int[m];

            int taroSum = 0;
            for (int i = 0; i < n; i++) {
                taro[i] = sc.nextInt();
                taroSum += taro[i];
            }

            int hanakoSum = 0;
            for (int i = 0; i < m; i++) {
                hanako[i] = sc.nextInt();
                hanakoSum += hanako[i];
            }

            int bestTaro = -1, bestHanako = -1;
            int minSum = Integer.MAX_VALUE;

            for (int i = 0; i < n; i++) {
                for (int j = 0; j < m; j++) {
                    int newTaroSum = taroSum - taro[i] + hanako[j];
                    int newHanakoSum = hanakoSum - hanako[j] + taro[i];

                    if (newTaroSum == newHanakoSum) {
                        int sum = taro[i] + hanako[j];
                        if (sum < minSum) {
                            minSum = sum;
                            bestTaro = taro[i];
                            bestHanako = hanako[j];
                        }
                    }
                }
            }

            if (bestTaro == -1) {
                System.out.println(-1);
            } else {
                System.out.println(bestTaro + " " + bestHanako);
            }
        }

        sc.close();
    }
}

