import java.util.*;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);

        while (true) {
            int N = sc.nextInt();
            if (N == 0) break;

            List<Set> knows = new ArrayList<>();
            for (int i = 0; i <= N; i++) {
                knows.add(new HashSet<>());
            }

            for (int i = 1; i <= N; i++) {
                int M = sc.nextInt();
                for (int j = 0; j < M; j++) {
                    int person = sc.nextInt();
                    knows.get(i).add(person);
                }
            }

            int K = sc.nextInt();
            Set leaked = new HashSet<>();
            for (int i = 0; i < K; i++) {
                leaked.add(sc.nextInt());
            }

            List suspects = new ArrayList<>();

            for (int i = 1; i <= N; i++) {
                boolean canLeak = true;
                for (int leakedPerson : leaked) {
                    if (!knows.get(i).contains(leakedPerson)) {
                        canLeak = false;
                        break;
                    }
                }
                if (canLeak) {
                    suspects.add(i);
                }
            }

            if (suspects.size() == 1) {
                System.out.println(suspects.get(0));
            } else {
                System.out.println(-1);
            }
        }

        sc.close();
    }
}

