import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int a = sc.nextInt();
        int b = sc.nextInt();
        int c = sc.nextInt();

        int count = 0;
        for (int i = 1; i * i <= c; i++) {
            if (c % i == 0) {
                if (i >= a && i <= b) {
                    count++;
                }
                int complement = c / i;
                if (complement != i && complement >= a && complement <= b) {
                    count++;
                }
            }
        }

        System.out.println(count);
        sc.close();
    }
}

