        int c = sc.nextInt();

        int count = 0;

        for (int i = 1; i * i <= c; i++) {
            if (c % i == 0) {
                if (i >= a && i <= b) {
                    count++;
                }

                int paired = c / i;
                if (paired != i && paired >= a && paired <= b) {
                    count++;
                }
            }
        }

        System.out.println(count);
        sc.close();
    }
}

