import java.util.*;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int q = sc.nextInt();

        int[] arr = new int[200000];
        int size = 0;

        for (int i = 0; i < q; i++) {
            int op = sc.nextInt();

            if (op == 0) {
                int x = sc.nextInt();
                arr[size++] = x;
            } else if (op == 1) {
                int p = sc.nextInt();
                System.out.println(arr[p]);
            } else {
                size--;
            }
        }

        sc.close();
    }
}

