import java.util.*;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int n = sc.nextInt();
        int q = sc.nextInt();

        PriorityQueue[] queues = new PriorityQueue[n];
        for (int i = 0; i < n; i++) {
            queues[i] = new PriorityQueue<>(Collections.reverseOrder());
        }

        for (int i = 0; i < q; i++) {
            int op = sc.nextInt();
            if (op == 0) {
                int t = sc.nextInt();
                int x = sc.nextInt();
                queues[t].offer(x);
            } else if (op == 1) {
                int t = sc.nextInt();
                if (!queues[t].isEmpty()) {
                    System.out.println(queues[t].peek());
                }
            } else if (op == 2) {
                int t = sc.nextInt();
                if (!queues[t].isEmpty()) {
                    queues[t].poll();
                }
            }
        }

        sc.close();
    }
}

