import java.util.*;

public class Main {
    static List<List> adj, radj;
    static boolean[] visited;
    static Stack finishOrder;
    static List<List> sccs;

    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int n = sc.nextInt();
        int m = sc.nextInt();

        adj = new ArrayList<>();
        radj = new ArrayList<>();
        for (int i = 0; i < n; i++) {
            adj.add(new ArrayList<>());
            radj.add(new ArrayList<>());
        }

        for (int i = 0; i < m; i++) {
            int a = sc.nextInt();
            int b = sc.nextInt();
            adj.get(a).add(b);
            radj.get(b).add(a);
        }

        visited = new boolean[n];
        finishOrder = new Stack<>();
        for (int i = 0; i < n; i++) {
            if (!visited[i]) {
                dfs1(i);
            }
        }

        visited = new boolean[n];
        sccs = new ArrayList<>();
        while (!finishOrder.isEmpty()) {
            int v = finishOrder.pop();
            if (!visited[v]) {
                List scc = new ArrayList<>();
                dfs2(v, scc);
                sccs.add(scc);
            }
        }

        System.out.println(sccs.size());
        for (List scc : sccs) {
            System.out.print(scc.size());
            for (int v : scc) {
                System.out.print(" " + v);
            }
            System.out.println();
        }
    }

    static void dfs1(int v) {
        visited[v] = true;
        for (int u : adj.get(v)) {
            if (!visited[u]) {
                dfs1(u);
            }
        }
        finishOrder.push(v);
    }

    static void dfs2(int v, List scc) {
        visited[v] = true;
        scc.add(v);
        for (int u : radj.get(v)) {
            if (!visited[u]) {
                dfs2(u, scc);
            }
        }
    }
}

import java.util.*;

public class Main {
    static List<List> graph, transpose;
    static boolean[] visited;
    static Stack finishOrder;
    static List<List> sccs;

    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int n = sc.nextInt();
        int m = sc.nextInt();

        graph = new ArrayList<>();
        transpose = new ArrayList<>();
        for (int i = 0; i < n; i++) {
            graph.add(new ArrayList<>());
            transpose.add(new ArrayList<>());
        }

        for (int i = 0; i < m; i++) {
            int a = sc.nextInt();
            int b = sc.nextInt();
            graph.get(a).add(b);
            transpose.get(b).add(a);
        }

        visited = new boolean[n];
        finishOrder = new Stack<>();
        for (int i = 0; i < n; i++) {
            if (!visited[i]) {
                dfs1(i);
            }
        }

        visited = new boolean[n];
        sccs = new ArrayList<>();
        while (!finishOrder.isEmpty()) {
            int v = finishOrder.pop();
            if (!visited[v]) {
                List scc = new ArrayList<>();
                dfs2(v, scc);
                sccs.add(scc);
            }
        }

        System.out.println(sccs.size());
        for (List scc : sccs) {
            System.out.print(scc.size());
            for (int v : scc) {
                System.out.print(" " + v);
            }
            System.out.println();
        }
    }

    static void dfs1(int v) {
        visited[v] = true;
        for (int u : graph.get(v)) {
            if (!visited[u]) {
                dfs1(u);
            }
        }
        finishOrder.push(v);
    }

    static void dfs2(int v, List scc) {
        visited[v] = true;
        scc.add(v);
        for (int u : transpose.get(v)) {
            if (!visited[u]) {
                dfs2(u, scc);
            }
        }
    }
