        }

        int count = 0;

        for (int rowMask = 0; rowMask < (1 << H); rowMask++) {
            for (int colMask = 0; colMask < (1 << W); colMask++) {
                int blackCount = 0;

                for (int i = 0; i < H; i++) {
                    for (int j = 0; j < W; j++) {
                        if (grid[i][j] == '#') {
                            boolean rowPainted = (rowMask & (1 << i)) != 0;
                            boolean colPainted = (colMask & (1 << j)) != 0;

                            if (!rowPainted && !colPainted) {
                                blackCount++;
                            }
                        }
                    }
                }

                if (blackCount == K) {
                    count++;
                }
            }
        }

        System.out.println(count);
    }
}

