public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int n = sc.nextInt();
        int[] a = new int[n];

        for (int i = 0; i < n; i++) {
            a[i] = sc.nextInt();
        }

        int count = 0;

        for (int i = 0; i < n; i++) {
            boolean hasDevisor = false;

            for (int j = 0; j < n; j++) {
                if (i != j && a[i] % a[j] == 0) {
                    hasDevisor = true;
                    break;
                }
            }

            if (!hasDevisor) {
                count++;
            }
        }

        System.out.println(count);
    }
}

