import java.util.*;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int N = sc.nextInt();
        int M = sc.nextInt();

        List<List> graph = new ArrayList<>();
        for (int i = 0; i <= N; i++) {
            graph.add(new ArrayList<>());
        }

        for (int i = 0; i < M; i++) {
            int a = sc.nextInt();
            int b = sc.nextInt();
            graph.get(a).add(b);
            graph.get(b).add(a);
        }

        int[] dist = new int[N + 1];
        Arrays.fill(dist, -1);
        Queue queue = new LinkedList<>();
        queue.offer(1);
        dist[1] = 0;

        while (!queue.isEmpty()) {
            int curr = queue.poll();
            for (int next : graph.get(curr)) {
                if (dist[next] == -1) {
                    dist[next] = dist[curr] + 1;
                    queue.offer(next);
                }
            }
        }

        int[] signpost = new int[N + 1];
        boolean possible = true;

        for (int i = 2; i <= N; i++) {
            boolean found = false;
            for (int neighbor : graph.get(i)) {
                if (dist[neighbor] == dist[i] - 1) {
                    signpost[i] = neighbor;
                    found = true;
                    break;
                }
            }
            if (!found) {
                possible = false;
                break;
            }
        }

        if (!possible) {
            System.out.println("No");
        } else {
            System.out.println("Yes");
            for (int i = 2; i <= N; i++) {
                System.out.println(signpost[i]);
            }
        }
    }
}

