import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int N = sc.nextInt();
        String S = sc.next();

        int count = 0;

        for (int j = 1; j < N - 1; j++) {
            for (int i = 0; i < j; i++) {
                for (int k = j + 1; k < N; k++) {
                    if (S.charAt(i) != S.charAt(j) &&
                        S.charAt(i) != S.charAt(k) &&
                        S.charAt(j) != S.charAt(k)) {

                        if ((j - i) != (k - j)) {
                            count++;
                        }
                    }
                }
            }
        }

        System.out.println(count);
    }
}

