import java.util.*;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int N = sc.nextInt();
        int K = sc.nextInt();
        int C = sc.nextInt();
        String S = sc.next();

        List earliest = new ArrayList<>();
        int pos = 0;
        for (int i = 0; i < K; i++) {
            while (pos < N && S.charAt(pos) == 'x') {
                pos++;
            }
            earliest.add(pos + 1);
            pos += C + 1;
        }

        List latest = new ArrayList<>();
        pos = N - 1;
        for (int i = 0; i < K; i++) {
            while (pos >= 0 && S.charAt(pos) == 'x') {
                pos--;
            }
            latest.add(pos + 1);
            pos -= C + 1;
        }
        Collections.reverse(latest);

        Set result = new HashSet<>();
        for (int i = 0; i < K; i++) {
            if (earliest.get(i).equals(latest.get(i))) {
                result.add(earliest.get(i));
            }
        }

        List answer = new ArrayList<>(result);
        Collections.sort(answer);

        for (int day : answer) {
            System.out.println(day);
        }
    }
}

