import java.util.*;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);

        int[][] grid = new int[3][3];
        boolean[][] marked = new boolean[3][3];

        for (int i = 0; i < 3; i++) {
            for (int j = 0; j < 3; j++) {
                grid[i][j] = sc.nextInt();
            }
        }

        int n = sc.nextInt();
        Set calledNumbers = new HashSet<>();

        for (int i = 0; i < n; i++) {
            calledNumbers.add(sc.nextInt());
        }

        for (int i = 0; i < 3; i++) {
            for (int j = 0; j < 3; j++) {
                if (calledNumbers.contains(grid[i][j])) {
                    marked[i][j] = true;
                }
            }
        }

        boolean bingo = false;

        for (int i = 0; i < 3; i++) {
            if (marked[i][0] && marked[i][1] && marked[i][2]) {
                bingo = true;
                break;
            }
        }

        if (!bingo) {
            for (int j = 0; j < 3; j++) {
                if (marked[0][j] && marked[1][j] && marked[2][j]) {
                    bingo = true;
                    break;
                }
            }
        }

        if (!bingo) {
            if ((marked[0][0] && marked[1][1] && marked[2][2]) ||
                (marked[0][2] && marked[1][1] && marked[2][0])) {
                bingo = true;
            }
        }

        System.out.println(bingo ? "Yes" : "No");
    }
}

