import java.util.*;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int n = sc.nextInt();
        int[] a = new int[n];

        for (int i = 0; i < n; i++) {
            a[i] = sc.nextInt();
        }

        int expected = 1;
        int kept = 0;

        for (int i = 0; i < n; i++) {
            if (a[i] == expected) {
                expected++;
                kept++;
            }
        }

        if (kept == 0) {
            System.out.println(-1);
        } else {
            System.out.println(n - kept);
        }
    }
}

