import java.util.*;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int n = sc.nextInt();
        long[] a = new long[n];

        for (int i = 0; i < n; i++) {
            a[i] = sc.nextLong();
        }

        long totalXor = 0;
        for (long x : a) {
            totalXor ^= x;
        }

        Set possibleXors = new HashSet<>();

        for (int mask = 1; mask < (1 << n) - 1; mask++) {
            long xor = 0;
            for (int i = 0; i < n; i++) {
                if ((mask & (1 << i)) != 0) {
                    xor ^= a[i];
                }
            }
            possibleXors.add(xor);
        }

        long maxBeauty = 0;
        for (long redXor : possibleXors) {
            long blueXor = totalXor ^ redXor;
            long beauty = redXor + blueXor;
            maxBeauty = Math.max(maxBeauty, beauty);
        }

        System.out.println(maxBeauty);
    }
}

import java.util.*;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int n = sc.nextInt();
        long[] a = new long[n];

        for (int i = 0; i < n; i++) {
            a[i] = sc.nextLong();
        }

        long totalXor = 0;
        for (long x : a) {
            totalXor ^= x;
        }

        Set possibleXors = new HashSet<>();

        for (int mask = 1; mask < (1 << n) - 1; mask++) {
            long xor = 0;
            for (int i = 0; i < n; i++) {
                if ((mask & (1 << i)) != 0) {
                    xor ^= a[i];
                }
            }
            possibleXors.add(xor);
        }

        long maxBeauty = 0;
        for (long redXor : possibleXors) {
            long blueXor = redXor ^ totalXor;
            long beauty = redXor + blueXor;
            maxBeauty = Math.max(maxBeauty, beauty);
        }

        System.out.println(maxBeauty);
    }
}

