import java.util.*;

public class Main {
    static class Edge {
        int to, cost;
        Edge(int to, int cost) {
            this.to = to;
            this.cost = cost;
        }
    }

    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int N = sc.nextInt();
        int M = sc.nextInt();
        int P = sc.nextInt();

        List[] graph = new List[N + 1];
        for (int i = 1; i <= N; i++) {
            graph[i] = new ArrayList<>();
        }

        for (int i = 0; i < M; i++) {
            int a = sc.nextInt();
            int b = sc.nextInt();
            int c = sc.nextInt();
            graph[a].add(new Edge(b, P - c));
        }

        long[] dist = new long[N + 1];
        Arrays.fill(dist, Long.MAX_VALUE);
        dist[1] = 0;

        for (int i = 0; i < N - 1; i++) {
            for (int u = 1; u <= N; u++) {
                if (dist[u] == Long.MAX_VALUE) continue;
                for (Edge e : graph[u]) {
                    if (dist[u] + e.cost < dist[e.to]) {
                        dist[e.to] = dist[u] + e.cost;
                    }
                }
            }
        }

        boolean[] hasPosCycle = new boolean[N + 1];
        for (int i = 0; i < N; i++) {
            for (int u = 1; u <= N; u++) {
                if (dist[u] == Long.MAX_VALUE) continue;
                for (Edge e : graph[u]) {
                    if (dist[u] + e.cost < dist[e.to]) {
                        dist[e.to] = dist[u] + e.cost;
                        hasPosCycle[e.to] = true;
                    }
                    if (hasPosCycle[u]) {
                        hasPosCycle[e.to] = true;
                    }
                }
            }
        }

        if (hasPosCycle[N]) {
            System.out.println(-1);
        } else if (dist[N] == Long.MAX_VALUE) {
            System.out.println(0);
        } else {
            System.out.println(Math.max(0, -dist[N]));
        }
    }
}

import java.util.*;

public class Main {
    static class Edge {
        int to, cost;
        Edge(int to, int cost) {
            this.to = to;
            this.cost = cost;
        }
    }

    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int N = sc.nextInt();
        int M = sc.nextInt();
        int P = sc.nextInt();

        List[] graph = new List[N + 1];
        for (int i = 1; i <= N; i++) {
            graph[i] = new ArrayList<>();
        }

        for (int i = 0; i < M; i++) {
            int a = sc.nextInt();
            int b = sc.nextInt();
            int c = sc.nextInt();
            graph[a].add(new Edge(b, P - c));
        }

        long[] dist = new long[N + 1];
        Arrays.fill(dist, Long.MAX_VALUE);
        dist[1] = 0;

        for (int i = 0; i < N - 1; i++) {
            for (int v = 1; v <= N; v++) {
                if (dist[v] == Long.MAX_VALUE) continue;
                for (Edge e : graph[v]) {
                    if (dist[v] + e.cost < dist[e.to]) {
                        dist[e.to] = dist[v] + e.cost;
                    }
                }
            }
        }

        boolean[] inNegCycle = new boolean[N + 1];
        for (int i = 0; i < N; i++) {
            for (int v = 1; v <= N; v++) {
                if (dist[v] == Long.MAX_VALUE) continue;
                for (Edge e : graph[v]) {
                    if (dist[v] + e.cost < dist[e.to]) {
                        dist[e.to] = dist[v] + e.cost;
                        inNegCycle[e.to] = true;
                    }
                    if (inNegCycle[v]) {
                        inNegCycle[e.to] = true;
                    }
                }
            }
        }

        if (inNegCycle[N]) {
            System.out.println(-1);
        } else if (dist[N] == Long.MAX_VALUE) {
            System.out.println(0);
        } else {
            System.out.println(Math.max(0, -dist[N]));
        }
    }
}

import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int N = sc.nextInt();

        String nStr = String.valueOf(N);
        int digits = nStr.length();

        int count = 0;

        for (int d = 1; d < digits; d += 2) {
            if (d == 1) {
                count += 9;
            } else {
                count += 9 * (int)Math.pow(10, d - 1);
            }
        }

        if (digits % 2 == 1) {
            if (digits == 1) {
                count += N;
            } else {
                count += N - (int)Math.pow(10, digits - 1) + 1;
            }
        }

        System.out.println(count);
    }
}

