import java.util.*;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int N = sc.nextInt();
        int M = sc.nextInt();

        int[][] bulbSwitches = new int[M][];
        for (int i = 0; i < M; i++) {
            int k = sc.nextInt();
            bulbSwitches[i] = new int[k];
            for (int j = 0; j < k; j++) {
                bulbSwitches[i][j] = sc.nextInt() - 1;
            }
        }

        int[] p = new int[M];
        for (int i = 0; i < M; i++) {
            p[i] = sc.nextInt();
        }

        int count = 0;

        for (int mask = 0; mask < (1 << N); mask++) {
            boolean allLit = true;

            for (int i = 0; i < M; i++) {
                int onCount = 0;

                for (int switchIdx : bulbSwitches[i]) {
                    if ((mask & (1 << switchIdx)) != 0) {
                        onCount++;
                    }
                }

                if (onCount % 2 != p[i]) {
                    allLit = false;
                    break;
                }
            }

            if (allLit) {
                count++;
            }
        }

        System.out.println(count);
    }
}

