import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);

        int n = sc.nextInt();
        int[] v = new int[n];
        int[] c = new int[n];

        for (int i = 0; i < n; i++) {
            v[i] = sc.nextInt();
        }

        for (int i = 0; i < n; i++) {
            c[i] = sc.nextInt();
        }

        int maxProfit = 0;

        for (int mask = 0; mask < (1 << n); mask++) {
            int totalValue = 0;
            int totalCost = 0;

            for (int i = 0; i < n; i++) {
                if ((mask & (1 << i)) != 0) {
                    totalValue += v[i];
                    totalCost += c[i];
                }
            }

            int profit = totalValue - totalCost;
            maxProfit = Math.max(maxProfit, profit);
        }

        System.out.println(maxProfit);
        sc.close();
    }
}

