import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int n = sc.nextInt();
        String s = sc.next();

        int minChanges = n;

        for (int cut = 0; cut <= n; cut++) {
            int changes = 0;

            for (int i = 0; i < cut; i++) {
                if (s.charAt(i) == '#') {
                    changes++;
                }
            }

            for (int i = cut; i < n; i++) {
                if (s.charAt(i) == '.') {
                    changes++;
                }
            }

            minChanges = Math.min(minChanges, changes);
        }

        System.out.println(minChanges);
    }
}

