import java.util.*;

public class Main {
    static final int MOD = 1000000007;
    static int N, X;
    static int[] S;
    static Map memo = new HashMap<>();

    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        N = sc.nextInt();
        X = sc.nextInt();
        S = new int[N];

        for (int i = 0; i < N; i++) {
            S[i] = sc.nextInt();
        }

        int fullMask = (1 << N) - 1;
        long result = solve(X, fullMask);
        System.out.println(result);
    }

    static long solve(int currentValue, int mask) {
        if (mask == 0) {
            return currentValue;
        }

        String key = currentValue + "," + mask;
        if (memo.containsKey(key)) {
            return memo.get(key);
        }

        long sum = 0;

        for (int i = 0; i < N; i++) {
            if ((mask & (1 << i)) != 0) {
                int newValue = currentValue % S[i];
                int newMask = mask ^ (1 << i);
                sum = (sum + solve(newValue, newMask)) % MOD;
            }
        }

        memo.put(key, sum);
        return sum;
    }
}

import java.util.*;

public class Main {
    static final int MOD = 1000000007;
    static int N, X;
    static int[] S;
    static Map memo = new HashMap<>();

    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        N = sc.nextInt();
        X = sc.nextInt();
        S = new int[N];

        for (int i = 0; i < N; i++) {
            S[i] = sc.nextInt();
        }

        int allMask = (1 << N) - 1;
        long result = solve(X, allMask);
        System.out.println(result);
    }

    static long solve(int currentValue, int mask) {
        if (mask == 0) {
            return currentValue;
        }

        String key = currentValue + "," + mask;
        if (memo.containsKey(key)) {
            return memo.get(key);
        }

        long sum = 0;

        for (int i = 0; i < N; i++) {
            if ((mask & (1 << i)) != 0) {
                int newValue = currentValue % S[i];
                int newMask = mask ^ (1 << i);
                sum = (sum + solve(newValue, newMask)) % MOD;
            }
        }

        memo.put(key, sum);
        return sum;
    }
}

import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int H = sc.nextInt();
        int W = sc.nextInt();
        int h = sc.nextInt();
        int w = sc.nextInt();

