import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);

        int N = sc.nextInt();
        int M = sc.nextInt();

        int[] foodCount = new int[M + 1];

        for (int i = 0; i < N; i++) {
            int K = sc.nextInt();
            for (int j = 0; j < K; j++) {
                int food = sc.nextInt();
                foodCount[food]++;
            }
        }

        int result = 0;
        for (int i = 1; i <= M; i++) {
            if (foodCount[i] == N) {
                result++;
            }
        }

        System.out.println(result);
        sc.close();
    }
}

