import java.util.*;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        long N = sc.nextLong();
        long P = sc.nextLong();

        long result = 1;

        for (long i = 2; i * i <= P; i++) {
            long count = 0;
            while (P % i == 0) {
                P /= i;
                count++;
            }
            if (count > 0) {
                long gcdPower = count / N;
                for (long j = 0; j < gcdPower; j++) {
                    result *= i;
                }
            }
        }

        if (P > 1) {
            if (N == 1) {
                result *= P;
            }
        }

        System.out.println(result);
    }
}

