                for (long j = 0; j < powerInGcd; j++) {
                    result *= i;
                }
            }
        }

        if (P > 1) {
            if (N == 1) {
                result *= P;
            }
        }

        System.out.println(result);
    }
}

import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        String s = sc.next();

        int operations = 0;
        int wCount = 0;

        for (int i = s.length() - 1; i >= 0; i--) {
            if (s.charAt(i) == 'W') {
                wCount++;
            } else {
                operations += wCount;
            }
        }

        System.out.println(operations);
    }
}

