import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);

        int n = sc.nextInt();
        int[] prices = new int[n];

        for (int i = 0; i < n; i++) {
            prices[i] = sc.nextInt();
        }

        int maxPrice = prices[0];
        for (int i = 1; i < n; i++) {
            if (prices[i] > maxPrice) {
                maxPrice = prices[i];
            }
        }

        int total = 0;
        for (int i = 0; i < n; i++) {
            total += prices[i];
        }
        total -= maxPrice / 2;

        System.out.println(total);
        sc.close();
    }
}

