import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int n = sc.nextInt();
        int[] a = new int[n];

        for (int i = 0; i < n; i++) {
            a[i] = sc.nextInt();
        }

        int spells = 0;
        int i = 0;

        while (i < n) {
            int j = i;
            while (j < n && a[j] == a[i]) {
                j++;
            }

            int groupSize = j - i;
            spells += groupSize / 2;

            i = j;
        }

        System.out.println(spells);
        sc.close();
    }
}

