import java.util.*;

public class Main {
    static class Cake {
        long x, y, z;

        Cake(long x, long y, long z) {
            this.x = x;
            this.y = y;
            this.z = z;
        }
    }

    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int N = sc.nextInt();
        int M = sc.nextInt();

        Cake[] cakes = new Cake[N];
        for (int i = 0; i < N; i++) {
            long x = sc.nextLong();
            long y = sc.nextLong();
            long z = sc.nextLong();
            cakes[i] = new Cake(x, y, z);
        }

        long maxValue = 0;

        for (int mask = 0; mask < 8; mask++) {
            int sx = (mask & 1) == 0 ? 1 : -1;
            int sy = (mask & 2) == 0 ? 1 : -1;
            int sz = (mask & 4) == 0 ? 1 : -1;

            long[] scores = new long[N];
            for (int i = 0; i < N; i++) {
                scores[i] = sx * cakes[i].x + sy * cakes[i].y + sz * cakes[i].z;
            }

            Integer[] indices = new Integer[N];
            for (int i = 0; i < N; i++) {
                indices[i] = i;
            }
            Arrays.sort(indices, (a, b) -> Long.compare(scores[b], scores[a]));

            long totalX = 0, totalY = 0, totalZ = 0;
            for (int i = 0; i < M; i++) {
                int idx = indices[i];
                totalX += cakes[idx].x;
                totalY += cakes[idx].y;
                totalZ += cakes[idx].z;
            }

            long value = Math.abs(totalX) + Math.abs(totalY) + Math.abs(totalZ);
            maxValue = Math.max(maxValue, value);
        }

        System.out.println(maxValue);
    }
}

import java.util.*;

public class Main {
    static class Cake {
        long x, y, z;
        Cake(long x, long y, long z) {
