import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int N = sc.nextInt();

        int[][] A = new int[2][N];
        for (int i = 0; i < 2; i++) {
            for (int j = 0; j < N; j++) {
                A[i][j] = sc.nextInt();
            }
        }

        int[][] dp = new int[2][N];

        dp[0][0] = A[0][0];

        for (int j = 1; j < N; j++) {
            dp[0][j] = dp[0][j-1] + A[0][j];
        }

        dp[1][0] = dp[0][0] + A[1][0];
        for (int j = 1; j < N; j++) {
            dp[1][j] = Math.max(dp[0][j], dp[1][j-1]) + A[1][j];
        }

        System.out.println(dp[1][N-1]);
        sc.close();
    }
}

