import java.util.*;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int n = sc.nextInt();
        long[][] a = new long[n][n];

        for (int i = 0; i < n; i++) {
            for (int j = 0; j < n; j++) {
                a[i][j] = sc.nextLong();
            }
        }

        for (int i = 0; i < n; i++) {
            for (int j = 0; j < n; j++) {
                for (int k = 0; k < n; k++) {
                    if (a[i][j] > a[i][k] + a[k][j]) {
                        System.out.println(-1);
                        return;
                    }
                }
            }
        }

        boolean[][] necessary = new boolean[n][n];
        for (int i = 0; i < n; i++) {
            for (int j = i + 1; j < n; j++) {
                necessary[i][j] = true;
                for (int k = 0; k < n; k++) {
                    if (k != i && k != j && a[i][j] == a[i][k] + a[k][j]) {
                        necessary[i][j] = false;
                        break;
                    }
                }
            }
        }

        long totalLength = 0;
        for (int i = 0; i < n; i++) {
            for (int j = i + 1; j < n; j++) {
                if (necessary[i][j]) {
                    totalLength += a[i][j];
                }
            }
        }

        System.out.println(totalLength);
    }
}

