import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int n = sc.nextInt();
        int[] p = new int[n + 1];

        for (int i = 1; i <= n; i++) {
            p[i] = sc.nextInt();
        }

        int swaps = 0;
        int i = 1;

        while (i <= n) {
            if (p[i] == i) {
                int segmentLength = 0;
                while (i <= n && p[i] == i) {
                    segmentLength++;
                    i++;
                }
                swaps += (segmentLength + 1) / 2;
            } else {
                i++;
            }
        }

        System.out.println(swaps);
        sc.close();
    }
}

