import java.util.*;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int n = sc.nextInt();
        long[] a = new long[n];
        for (int i = 0; i < n; i++) {
            a[i] = sc.nextLong();
        }

        long cost1 = solve(a, true);
        long cost2 = solve(a, false);

        System.out.println(Math.min(cost1, cost2));
    }

    static long solve(long[] a, boolean startPositive) {
        int n = a.length;
        long cost = 0;
        long prefixSum = 0;

        for (int i = 0; i < n; i++) {
            prefixSum += a[i];

            boolean shouldBePositive = (i % 2 == 0) ? startPositive : !startPositive;

            if (shouldBePositive) {
                if (prefixSum < 1) {
                    cost += 1 - prefixSum;
                    prefixSum = 1;
                }
            } else {
                if (prefixSum > -1) {
                    cost += prefixSum - (-1);
                    prefixSum = -1;
                }
            }
        }

        return cost;
    }
}

import java.util.*;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int n = sc.nextInt();
        long[] a = new long[n];
        for (int i = 0; i < n; i++) {
            a[i] = sc.nextLong();
        }

        long cost1 = solve(a, true);
        long cost2 = solve(a, false);

        System.out.println(Math.min(cost1, cost2));
    }

    static long solve(long[] a, boolean startPositive) {
        int n = a.length;
        long operations = 0;
        long prefixSum = 0;

        for (int i = 0; i < n; i++) {
            prefixSum += a[i];

            boolean shouldBePositive = (i % 2 == 0) ? startPositive : !startPositive;

            if (shouldBePositive) {
                if (prefixSum < 1) {
                    operations += 1 - prefixSum;
                    prefixSum = 1;
                }
            } else {
                if (prefixSum > -1) {
                    operations += prefixSum - (-1);
                    prefixSum = -1;
                }
            }
        }

        return operations;
    }
}

import java.util.*;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int n = sc.nextInt();
        String[] strings = new String[n];

        for (int i = 0; i < n; i++) {
            strings[i] = sc.next();
        }

        int[][] freq = new int[n][26];
        for (int i = 0; i < n; i++) {
            for (char c : strings[i].toCharArray()) {
                freq[i][c - 'a']++;
            }
        }

        int[] minFreq = new int[26];
        for (int j = 0; j < 26; j++) {
            minFreq[j] = Integer.MAX_VALUE;
            for (int i = 0; i < n; i++) {
                minFreq[j] = Math.min(minFreq[j], freq[i][j]);
            }
        }

        StringBuilder result = new StringBuilder();
        for (int j = 0; j < 26; j++) {
            for (int k = 0; k < minFreq[j]; k++) {
                result.append((char)('a' + j));
            }
        }

        System.out.println(result.toString());
    }
}

