import java.util.*;

public class Main {
    static final int MOD = 1000000007;

    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int n = sc.nextInt();
        long a = sc.nextLong();
        long b = sc.nextLong();

        long[] s = new long[n];
        for (int i = 0; i < n; i++) {
            s[i] = sc.nextLong();
        }

        long[][][] dp = new long[n + 1][n + 1][n + 1];
        dp[0][n][n] = 1;

        for (int i = 0; i < n; i++) {
            for (int j = 0; j <= n; j++) {
                for (int k = 0; k <= n; k++) {
                    if (dp[i][j][k] == 0) continue;

                    boolean canAddToX = (j == n) || (s[i] - s[j] >= a);
                    if (canAddToX) {
                        dp[i + 1][i][k] = (dp[i + 1][i][k] + dp[i][j][k]) % MOD;
                    }

                    boolean canAddToY = (k == n) || (s[i] - s[k] >= b);
                    if (canAddToY) {
                        dp[i + 1][j][i] = (dp[i + 1][j][i] + dp[i][j][k]) % MOD;
                    }
                }
            }
        }

        long result = 0;
        for (int j = 0; j <= n; j++) {
            for (int k = 0; k <= n; k++) {
                result = (result + dp[n][j][k]) % MOD;
            }
        }

        System.out.println(result);
    }
}

import java.util.*;

public class Main {
    static final int MOD = 1000000007;

    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int n = sc.nextInt();
        long a = sc.nextLong();
        long b = sc.nextLong();

        long[] s = new long[n];
        for (int i = 0; i < n; i++) {
            s[i] = sc.nextLong();
        }

        long[][][] dp = new long[n + 1][n + 1][n + 1];
        dp[0][n][n] = 1;

        for (int i = 0; i < n; i++) {
            for (int j = 0; j <= n; j++) {
                for (int k = 0; k <= n; k++) {
                    if (dp[i][j][k] == 0) continue;

                    boolean canPutInX = (j == n) || (s[i] - s[j] >= a);
                    if (canPutInX) {
                        dp[i + 1][i][k] = (dp[i + 1][i][k] + dp[i][j][k]) % MOD;
                    }

                    boolean canPutInY = (k == n) || (s[i] - s[k] >= b);
                    if (canPutInY) {
                        dp[i + 1][j][i] = (dp[i + 1][j][i] + dp[i][j][k]) % MOD;
                    }
                }
            }
        }

        long result = 0;
        for (int j = 0; j <= n; j++) {
            for (int k = 0; k <= n; k++) {
                result = (result + dp[n][j][k]) % MOD;
            }
        }

        System.out.println(result);
    }
}

import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int n = sc.nextInt();
        String s = sc.next();

        int x = 0;
        int maxX = 0;

        for (int i = 0; i < n; i++) {
            if (s.charAt(i) == 'I') {
                x++;
            } else {
                x--;
            }
            maxX = Math.max(maxX, x);
        }

        System.out.println(maxX);
        sc.close();
    }
}

