import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int sx = sc.nextInt();
        int sy = sc.nextInt();
        int tx = sc.nextInt();
        int ty = sc.nextInt();

        StringBuilder result = new StringBuilder();

        for (int i = 0; i < tx - sx; i++) {
            result.append('R');
        }
        for (int i = 0; i < ty - sy; i++) {
            result.append('U');
        }

        for (int i = 0; i < ty - sy; i++) {
            result.append('D');
        }
        for (int i = 0; i < tx - sx; i++) {
            result.append('L');
        }

        result.append('L');
        for (int i = 0; i < ty - sy + 1; i++) {
            result.append('U');
        }
        for (int i = 0; i < tx - sx + 1; i++) {
            result.append('R');
        }
        result.append('D');

        result.append('R');
        for (int i = 0; i < ty - sy + 1; i++) {
            result.append('D');
        }
        for (int i = 0; i < tx - sx + 1; i++) {
            result.append('L');
        }
        result.append('U');

        System.out.println(result.toString());
    }
}

import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int sx = sc.nextInt();
        int sy = sc.nextInt();
        int tx = sc.nextInt();
        int ty = sc.nextInt();

        StringBuilder path = new StringBuilder();

        for (int i = 0; i < tx - sx; i++) {
            path.append('R');
        }
        for (int i = 0; i < ty - sy; i++) {
            path.append('U');
        }

        for (int i = 0; i < ty - sy; i++) {
            path.append('D');
        }
        for (int i = 0; i < tx - sx; i++) {
            path.append('L');
        }

        path.append('L');
        for (int i = 0; i < ty - sy + 1; i++) {
            path.append('U');
        }
        for (int i = 0; i < tx - sx + 2; i++) {
            path.append('R');
        }
        path.append('D');

        path.append('R');
        for (int i = 0; i < ty - sy + 1; i++) {
            path.append('D');
        }
        for (int i = 0; i < tx - sx + 2; i++) {
            path.append('L');
        }
        path.append('U');

        System.out.println(path.toString());
    }
}

