        }
        for (int i = 0; i < ty - sy; i++) {
            path.append('U');
        }

        for (int i = 0; i < ty - sy; i++) {
            path.append('D');
        }
        for (int i = 0; i < tx - sx; i++) {
            path.append('L');
        }

        path.append('L');
        for (int i = 0; i < ty - sy + 1; i++) {
            path.append('U');
        }
        for (int i = 0; i < tx - sx + 1; i++) {
            path.append('R');
        }
        path.append('D');

        path.append('R');
        for (int i = 0; i < ty - sy + 1; i++) {
            path.append('D');
        }
        for (int i = 0; i < tx - sx + 1; i++) {
            path.append('L');
        }
        path.append('U');

        System.out.println(path.toString());
    }
}

