import java.util.*;

public class Main {
    static class UnionFind {
        int[] parent, size;

        UnionFind(int n) {
            parent = new int[n];
            size = new int[n];
            for (int i = 0; i < n; i++) {
                parent[i] = i;
                size[i] = 1;
            }
        }

        int find(int x) {
            if (parent[x] != x) {
                parent[x] = find(parent[x]);
            }
            return parent[x];
        }

        void union(int x, int y) {
            x = find(x);
            y = find(y);
            if (x != y) {
                if (size[x] < size[y]) {
                    int temp = x;
                    x = y;
                    y = temp;
                }
                parent[y] = x;
                size[x] += size[y];
            }
        }

        boolean connected(int x, int y) {
            return find(x) == find(y);
        }
    }

    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int N = sc.nextInt();
        int K = sc.nextInt();
        int L = sc.nextInt();

        UnionFind roadUF = new UnionFind(N);
        UnionFind railUF = new UnionFind(N);

        for (int i = 0; i < K; i++) {
            int p = sc.nextInt() - 1;
            int q = sc.nextInt() - 1;
            roadUF.union(p, q);
        }

        for (int i = 0; i < L; i++) {
            int r = sc.nextInt() - 1;
            int s = sc.nextInt() - 1;
            railUF.union(r, s);
        }

        for (int i = 0; i < N; i++) {
            int count = 0;
            for (int j = 0; j < N; j++) {
                if (roadUF.connected(i, j) && railUF.connected(i, j)) {
                    count++;
                }
            }
            System.out.print(count);
            if (i < N - 1) System.out.print(" ");
        }
        System.out.println();

        sc.close();
    }
}

