    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int n = sc.nextInt();

        long totalProducts = 0;
        for (int i = 0; i < n; i++) {
            int cash = sc.nextInt();
            totalProducts += cash - 1;
        }

        System.out.println(totalProducts);
        sc.close();
    }
}

import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int n = sc.nextInt();
        int[] a = new int[n + 1];

        for (int i = 1; i <= n; i++) {
            a[i] = sc.nextInt();
        }

        int friendlyPairs = 0;

        for (int i = 1; i <= n; i++) {
            for (int j = i + 1; j <= n; j++) {
                if (a[i] == j && a[j] == i) {
                    friendlyPairs++;
                }
            }
        }

        System.out.println(friendlyPairs);
        sc.close();
    }
}

