import java.util.*;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int N = sc.nextInt();
        int K = sc.nextInt();

        Set disliked = new HashSet<>();
        for (int i = 0; i < K; i++) {
            disliked.add(sc.nextInt());
        }

        int amount = N;
        while (true) {
            if (isValid(amount, disliked)) {
                System.out.println(amount);
                break;
            }
            amount++;
        }
    }

    private static boolean isValid(int num, Set disliked) {
        String str = String.valueOf(num);
        for (char c : str.toCharArray()) {
            int digit = c - '0';
            if (disliked.contains(digit)) {
                return false;
            }
        }
        return true;
    }
}

