public class Main {
    public static void main(String[] args) {
        Scanner scanner = new Scanner(System.in);
        while (true) {
            int n = scanner.nextInt();
            if (n == 0) break;

            int[] counts = new int[10];
            for (int i = 0; i < n; i++) {
                int c = scanner.nextInt();
                counts[c]++;
            }

            for (int i = 0; i < 10; i++) {
                if (counts[i] == 0) {
                    System.out.println("-");
                } else {
                    System.out.println("*".repeat(counts[i]));
