import java.util.Scanner;

public class Main {
    static int minDiff;

    public static void main(String[] args) {
        Scanner scanner = new Scanner(System.in);
        while (true) {
            int n = scanner.nextInt();
            if (n == 0) break;
            int[] a = new int[n];
            for (int i = 0; i < n; i++) {
                a[i] = scanner.nextInt();
            }
            minDiff = Integer.MAX_VALUE;
            dfs(a, 0, 0, 0);
            System.out.println(minDiff);
        }
    }

    static void dfs(int[] a, int index, int sumA, int sumB) {
        if (index == a.length) {
            int diff = Math.abs(sumA - sumB);
            if (diff < minDiff) {
                minDiff = diff;
            }
            return;
        }
        dfs(a, index + 1, sumA + a[index], sumB);
        dfs(a, index + 1, sumA, sumB + a[index]);
    }
}

import java.util.Scanner;

public class Main {
    static int minDiff;

    public static void main(String[] args) {
        Scanner scanner = new Scanner(System.in);
        while (true) {
            int n = scanner.nextInt();
            if (n == 0) break;
            int[] arr = new int[n];
            for (int i = 0; i < n; i++) {
                arr[i] = scanner.nextInt();
            }
            minDiff = Integer.MAX_VALUE;
            backtrack(arr, 0, 0, 0);
            System.out.println(minDiff);
        }
    }

    static void backtrack(int[] arr, int index, int sumA, int sumB) {
        if (index == arr.length) {
            int diff = Math.abs(sumA - sumB);
            if (diff < minDiff) {
                minDiff = diff;
            }
            return;
        }
        backtrack(arr, index + 1, sumA + arr[index], sumB);
        backtrack(arr, index + 1, sumA, sumB + arr[index]);
    }
}

import java.util.Arrays;
import java.util.Scanner;

public class Spellcasters {
    public static void main(String[] args) {
        Scanner scanner = new Scanner(System.in);
        while (true) {
            int n = scanner.nextInt();
            int S = scanner.nextInt();
            if (n == 0 && S == 0) {
                break;
            }
            int[] r = new int[n];
            for (int i = 0; i < n; i++) {
                r[i] = scanner.nextInt();
            }
            Arrays.sort(r);
            int count = 0;
            int left = 0;
            int right = n - 1;
            while (left < right) {
                if (r[left] + r[right] > S) {
                    count += right - left;
                    right--;
                } else {
                    left++;
                }
            }
            System.out.println(count);
        }
    }
}

import java.util.Arrays;
import java.util.Scanner;

public class Spellcasters {
