        Scanner scanner = new Scanner(System.in);
        while (true) {
            int n = scanner.nextInt();
            int S = scanner.nextInt();
            if (n == 0 && S == 0) {
                break;
            }
            int[] r = new int[n];
            for (int i = 0; i < n; i++) {
                r[i] = scanner.nextInt();
            }
            Arrays.sort(r);
            int count = 0;
            int left = 0;
            int right = n - 1;
            while (left < right) {
                if (r[left] + r[right] > S) {
                    count += right - left;
                    right--;
                } else {
                    left++;
                }
            }
            System.out.println(count);
        }
    }
}

