import java.util.*;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int H = sc.nextInt();
        int W = sc.nextInt();
        int[][] grid = new int[H][W];

        for (int i = 0; i < H; i++) {
            String line = sc.next();
            for (int j = 0; j < W; j++) {
                grid[i][j] = line.charAt(j) - '0';
            }
        }

        int[][] dp = new int[H][W];
        dp[0][0] = 0;

        for (int i = 0; i < H; i++) {
            for (int j = 0; j < W; j++) {
                if (i == 0 && j == 0) continue;
                int min = Integer.MAX_VALUE;
                if (i > 0) {
                    min = Math.min(min, dp[i-1][j]);
                }
                if (j > 0) {
                    min = Math.min(min, dp[i][j-1]);
                }
                dp[i][j] = min + grid[i][j];
            }
        }

        System.out.println(dp[H-1][W-1]);
    }
}

