import java.util.Scanner;

public class Partition {
    public static void main(String[] args) {
        Scanner scanner = new Scanner(System.in);
        int n = scanner.nextInt();
        int[] A = new int[n];
        for (int i = 0; i < n; i++) {
            A[i] = scanner.nextInt();
        }

        int pivotIndex = partition(A, 0, n - 1);

        StringBuilder output = new StringBuilder();
        for (int i = 0; i < n; i++) {
            if (i == pivotIndex) {
                output.append("[").append(A[i]).append("]");
            } else {
                output.append(A[i]);
            }
            if (i != n - 1) {
                output.append(" ");
            }
        }
        System.out.println(output.toString());
    }

    private static int partition(int[] A, int p, int r) {
        int x = A[r];
        int i = p - 1;
        for (int j = p; j < r; j++) {
            if (A[j] <= x) {
                i++;
                swap(A, i, j);
            }
        }
        swap(A, i + 1, r);
        return i + 1;
    }

    private static void swap(int[] A, int i, int j) {
        int temp = A[i];
        A[i] = A[j];
        A[j] = temp;
    }
}

import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        double x0 = sc.nextDouble();
        double y0 = sc.nextDouble();
        double x1 = sc.nextDouble();
        double y1 = sc.nextDouble();
        int q = sc.nextInt();

        for (int i = 0; i < q; i++) {
            double x2 = sc.nextDouble();
            double y2 = sc.nextDouble();
            double cross = (x1 - x0) * (y2 - y0) - (y1 - y0) * (x2 - x0);

            if (cross > 0) {
                System.out.println("COUNTER_CLOCKWISE");
            } else if (cross < 0) {
                System.out.println("CLOCKWISE");
            } else {
                double dot = (x2 - x0) * (x1 - x0) + (y2 - y0) * (y1 - y0);
                if (dot < 0) {
                    System.out.println("ONLINE_BACK");
                } else {
                    double len1 = (x1 - x0) * (x1 - x0) + (y1 - y0) * (y1 - y0);
                    double len2 = (x2 - x0) * (x2 - x0) + (y2 - y0) * (y2 - y0);
                    if (len1 < len2) {
                        System.out.println("ONLINE_FRONT");
                    } else {
                        System.out.println("ON_SEGMENT");
                    }
                }
            }
        }
    }
}

import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner scanner = new Scanner(System.in);
        double x0 = scanner.nextDouble();
        double y0 = scanner.nextDouble();
        double x1 = scanner.nextDouble();
        double y1 = scanner.nextDouble();

        int q = scanner.nextInt();

        for (int i = 0; i < q; i++) {
            double x2 = scanner.nextDouble();
            double y2 = scanner.nextDouble();

            double cross = (x1 - x0) * (y2 - y0) - (y1 - y0) * (x2 - x0);

            if (cross > 0) {
                System.out.println("COUNTER_CLOCKWISE");
            } else if (cross < 0) {
                System.out.println("CLOCKWISE");
            } else {
                double dot = (x1 - x0) * (x2 - x0) + (y1 - y0) * (y2 - y0);
                if (dot < 0) {
                    System.out.println("ONLINE_BACK");
                } else {
                    double len1 = (x1 - x0) * (x1 - x0) + (y1 - y0) * (y1 - y0);
                    double len2 = (x2 - x0) * (x2 - x0) + (y2 - y0) * (y2 - y0);
                    if (len1 < len2) {
                        System.out.println("ONLINE_FRONT");
                    } else {
                        System.out.println("ON_SEGMENT");
                    }
                }
            }
        }
    }
}

import java.util.Arrays;
import java.util.Scanner;

public class CoinChanging {
    public static void main(String[] args) {
        Scanner scanner = new Scanner(System.in);
        int n = scanner.nextInt();
        int m = scanner.nextInt();
        int[] coins = new int[m];
        for (int i = 0; i < m; i++) {
            coins[i] = scanner.nextInt();
        }

        int[] dp = new int[n + 1];
        Arrays.fill(dp, Integer.MAX_VALUE);
        dp[0] = 0;

        for (int coin : coins) {
            for (int amount = coin; amount <= n; amount++) {
                if (dp[amount - coin] != Integer.MAX_VALUE) {
                    dp[amount] = Math.min(dp[amount], dp[amount - coin] + 1);
                }
            }
        }

        System.out.println(dp[n]);
    }
}

