import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int A = sc.nextInt();
        int B = sc.nextInt();
        int C = sc.nextInt();
        int K = sc.nextInt();

        boolean success = false;

        for (int a = 0; a <= K; a++) {
            for (int b = 0; b <= K - a; b++) {
                int c = K - a - b;
                int red = A * (1 << a);
                int green = B * (1 << b);
                int blue = C * (1 << c);
                if (green > red && blue > green) {
                    success = true;
                    break;
                }
            }
            if (success) break;
        }

        System.out.println(success ? "Yes" : "No");
    }
}

import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner scanner = new Scanner(System.in);
        int A = scanner.nextInt();
        int B = scanner.nextInt();
        int C = scanner.nextInt();
        int K = scanner.nextInt();

        boolean success = false;

        for (int a = 0; a <= K; a++) {
            for (int b = 0; b <= K - a; b++) {
                int c = K - a - b;
                int newA = A * (1 << a);
                int newB = B * (1 << b);
                int newC = C * (1 << c);
                if (newB > newA && newC > newB) {
                    success = true;
                    break;
                }
            }
            if (success) break;
        }

        System.out.println(success ? "Yes" : "No");
    }
}

