import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner scanner = new Scanner(System.in);
        int D = scanner.nextInt();
        int[] c = new int[26];
        for (int i = 0; i < 26; i++) {
            c[i] = scanner.nextInt();
        }
        int[][] s = new int[D][26];
        for (int i = 0; i < D; i++) {
            for (int j = 0; j < 26; j++) {
                s[i][j] = scanner.nextInt();
            }
        }
        int[] t = new int[D];
        for (int i = 0; i < D; i++) {
            t[i] = scanner.nextInt() - 1;
        }

        int[] last = new int[26];
        int satisfaction = 0;
        for (int d = 0; d < D; d++) {
            int contestType = t[d];
            satisfaction += s[d][contestType];
            last[contestType] = d + 1;

            for (int i = 0; i < 26; i++) {
                satisfaction -= c[i] * (d + 1 - last[i]);
            }
            System.out.println(satisfaction);
        }
    }
}

import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner scanner = new Scanner(System.in);

        int D = scanner.nextInt();
        int[] c = new int[26];
        for (int i = 0; i < 26; i++) {
            c[i] = scanner.nextInt();
        }

        int[][] s = new int[D][26];
        for (int i = 0; i < D; i++) {
            for (int j = 0; j < 26; j++) {
                s[i][j] = scanner.nextInt();
            }
        }

        int[] t = new int[D];
        for (int i = 0; i < D; i++) {
            t[i] = scanner.nextInt() - 1;
        }

        int[] last = new int[26];
        int satisfaction = 0;
        for (int d = 0; d < D; d++) {
            int type = t[d];
            satisfaction += s[d][type];
            last[type] = d + 1;

            for (int i = 0; i < 26; i++) {
                satisfaction -= c[i] * (d + 1 - last[i]);
            }

            System.out.println(satisfaction);
        }
    }
}

