        Scanner sc = new Scanner(System.in);
        long N = sc.nextLong();
        StringBuilder sb = new StringBuilder();

        while (N > 0) {
            N--;
            char c = (char) ('a' + (N % 26));
            sb.append(c);
            N /= 26;
        }

        System.out.println(sb.reverse().toString());
    }
}

