import java.util.*;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int N = sc.nextInt();
        int M = sc.nextInt();
        int[] A = new int[N];
        int total = 0;

        for (int i = 0; i < N; i++) {
            A[i] = sc.nextInt();
            total += A[i];
        }

        Arrays.sort(A);
        int count = 0;
        double threshold = total / (4.0 * M);

        for (int i = N - 1; i >= 0; i--) {
            if (A[i] >= threshold) {
                count++;
                if (count >= M) {
                    System.out.println("Yes");
                    return;
                }
            } else {
                break;
            }
        }

        System.out.println("No");
    }
}

