import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int N = sc.nextInt();
        int[] V = new int[N];
        int[] C = new int[N];

        for (int i = 0; i < N; i++) {
            V[i] = sc.nextInt();
        }
        for (int i = 0; i < N; i++) {
            C[i] = sc.nextInt();
        }

        int max = 0;
        for (int mask = 0; mask < (1 << N); mask++) {
            int x = 0, y = 0;
            for (int i = 0; i < N; i++) {
                if ((mask & (1 << i)) != 0) {
                    x += V[i];
                    y += C[i];
                }
            }
            max = Math.max(max, x - y);
        }
        System.out.println(max);
    }
}

