import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        long A = sc.nextLong();
        long B = sc.nextLong();
        int K = sc.nextInt();

        for (int i = 0; i < K; i++) {
            if (i % 2 == 0) {
                if (A % 2 != 0) {
                    A--;
                }
                long half = A / 2;
                A -= half;
                B += half;
            } else {
                if (B % 2 != 0) {
                    B--;
                }
                long half = B / 2;
                B -= half;
                A += half;
            }
        }
        System.out.println(A + " " + B);
    }
}

import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        long a = sc.nextLong();
        long b = sc.nextLong();
        int k = sc.nextInt();

        for (int i = 0; i < k; i++) {
            if (i % 2 == 0) {
                if (a % 2 != 0) {
                    a--;
                }
                long half = a / 2;
                a -= half;
                b += half;
            } else {
                if (b % 2 != 0) {
                    b--;
                }
                long half = b / 2;
                b -= half;
                a += half;
            }
        }
        System.out.println(a + " " + b);
    }
}

import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        long A = sc.nextLong();
        long B = sc.nextLong();
        int K = sc.nextInt();

        for (int i = 0; i < K; i++) {
            if (i % 2 == 0) {
                if (A % 2 != 0) {
                    A--;
                }
                long give = A / 2;
                A -= give;
                B += give;
            } else {
                if (B % 2 != 0) {
                    B--;
                }
                long give = B / 2;
                B -= give;
                A += give;
            }
        }

        System.out.println(A + " " + B);
    }
}

