import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int N = sc.nextInt();
        int K = sc.nextInt();

        int minValue = Integer.MAX_VALUE;
        for (int x = 0; x <= N; x++) {
            int current = 1;
            for (int i = 0; i < x; i++) {
                current *= 2;
            }
            current += K * (N - x);
            if (current < minValue) {
                minValue = current;
            }
        }
        System.out.println(minValue);
    }
}

