import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int N = sc.nextInt();
        int K = sc.nextInt();
        int[] x = new int[N];
        for (int i = 0; i < N; i++) {
            x[i] = sc.nextInt();
        }

        int totalDistance = 0;
        for (int i = 0; i < N; i++) {
            int distanceA = 2 * x[i];
            int distanceB = 2 * (K - x[i]);
            totalDistance += Math.min(distanceA, distanceB);
        }

        System.out.println(totalDistance);
        sc.close();
    }
}

