import java.util.*;

public class Main {
    static int N, M;
    static boolean[][] adj;
    static int count = 0;

    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        N = sc.nextInt();
        M = sc.nextInt();
        adj = new boolean[N+1][N+1];

        for (int i = 0; i < M; i++) {
            int a = sc.nextInt();
            int b = sc.nextInt();
            adj[a][b] = true;
            adj[b][a] = true;
        }

        boolean[] visited = new boolean[N+1];
        visited[1] = true;
        dfs(1, 1, visited);
        System.out.println(count);
    }

    static void dfs(int current, int visitedCount, boolean[] visited) {
        if (visitedCount == N) {
            count++;
            return;
        }

        for (int next = 1; next <= N; next++) {
            if (adj[current][next] && !visited[next]) {
                visited[next] = true;
                dfs(next, visitedCount + 1, visited);
                visited[next] = false;
            }
        }
    }
}

import java.util.*;

public class Main {
    static int N, M;
    static boolean[][] graph;
    static int count = 0;

    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        N = sc.nextInt();
        M = sc.nextInt();
        graph = new boolean[N+1][N+1];

        for (int i = 0; i < M; i++) {
            int a = sc.nextInt();
            int b = sc.nextInt();
            graph[a][b] = true;
            graph[b][a] = true;
        }

        boolean[] visited = new boolean[N+1];
        visited[1] = true;
        dfs(1, 1, visited);
        System.out.println(count);
    }

    static void dfs(int current, int visitedCount, boolean[] visited) {
        if (visitedCount == N) {
            count++;
            return;
        }

        for (int next = 1; next <= N; next++) {
            if (graph[current][next] && !visited[next]) {
                visited[next] = true;
                dfs(next, visitedCount + 1, visited);
                visited[next] = false;
            }
        }
    }
}

