public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int N = sc.nextInt();
        long T = 1, A = 1;

        for (int i = 0; i < N; i++) {
            long t = sc.nextLong();
            long a = sc.nextLong();
            long k = Math.max((T + t - 1) / t, (A + a - 1) / a);
            T = t * k;
            A = a * k;
        }
        System.out.println(T + A);
    }
}

import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int N = sc.nextInt();
        long T = 1, A = 1;

        for (int i = 0; i < N; i++) {
            long Ti = sc.nextLong();
            long Ai = sc.nextLong();

            long k = Math.max((T + Ti - 1) / Ti, (A + Ai - 1) / Ai);
            T = k * Ti;
            A = k * Ai;
        }

        System.out.println(T + A);
    }
}

