import java.util.*;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        String S = sc.next();
        int n = S.length();
        long sum = 0;

        for (int mask = 0; mask < (1 << (n - 1)); mask++) {
            long current = 0;
            long num = S.charAt(0) - '0';

            for (int i = 1; i < n; i++) {
                if ((mask & (1 << (i - 1))) != 0) {
                    current += num;
                    num = 0;
                }
                num = num * 10 + (S.charAt(i) - '0');
            }
            current += num;
            sum += current;
        }
        System.out.println(sum);
    }
}

