import java.util.Scanner;

public class HotelCost {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int N = sc.nextInt();
        int K = sc.nextInt();
        int X = sc.nextInt();
        int Y = sc.nextInt();

        int total = 0;
        if (N <= K) {
            total = N * X;
        } else {
            total = K * X + (N - K) * Y;
        }
        System.out.println(total);
    }
}

