        int[] A = new int[N];
        for (int i = 0; i < N; i++) {
            A[i] = Integer.parseInt(br.readLine());
        }

        int[] sortedA = A.clone();
        Arrays.sort(sortedA);
        Map posMap = new HashMap<>();
        for (int i = 0; i < N; i++) {
            posMap.put(A[i], i);
        }

        int count = 0;
        for (int i = 0; i < N; i++) {
            int originalPos = posMap.get(sortedA[i]);
            if ((originalPos - i) % 2 != 0) {
                count++;
            }
        }

        System.out.println(count / 2);
    }
}

