import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        while (sc.hasNext()) {
            int a = sc.nextInt();
            int b = sc.nextInt();
            int n = sc.nextInt();

            int sum = 0;
            for (int i = 0; i < n; i++) {
                a *= 10;
                sum += (a / b);
                a %= b;
            }
            System.out.println(sum);
        }
        sc.close();
    }
}

