import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        while (sc.hasNextDouble()) {
            double a = sc.nextDouble();
            double sum = a;
            double prev = a;
            for (int i = 2; i <= 10; i++) {
                if (i % 2 == 0) {
                    prev *= 2;
                } else {
                    prev /= 3;
                }
                sum += prev;
            }
            System.out.printf("%.8f\n", sum);
        }
        sc.close();
    }
}

