                    prev /= 3;
                }
                sum += prev;
            }
            System.out.printf("%.8f\n", sum);
        }
        sc.close();
    }
}

import java.util.Scanner;

public class Main {

    static int n;
    static int s;
    static int count;
    static boolean[] used;

    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);

        while (sc.hasNext()) {
            n = sc.nextInt();
            s = sc.nextInt();
            count = 0;
            used = new boolean[10];

            dfs(0, 0);
            System.out.println(count);
        }

        sc.close();
    }

    static void dfs(int index, int sum) {
        if (index == n) {
            if (sum == s) {
                count++;
            }
            return;
        }

        for (int i = 0; i <= 9; i++) {
            if (!used[i]) {
                used[i] = true;
                dfs(index + 1, sum + (index + 1) * i);
                used[i] = false;
            }
        }
    }
}

import java.util.Scanner;

public class Main {

    static int n;
    static int s;
    static int count;
    static boolean[] used;

    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);

        while (sc.hasNext()) {
            n = sc.nextInt();
            s = sc.nextInt();

            count = 0;
            used = new boolean[10];

            dfs(0, 0);
            System.out.println(count);
        }
        sc.close();
    }

    static void dfs(int index, int currentSum) {
        if (index == n) {
            if (currentSum == s) {
                count++;
            }
            return;
        }

        for (int i = 0; i <= 9; i++) {
            if (!used[i]) {
                used[i] = true;
                dfs(index + 1, currentSum + (index + 1) * i);
                used[i] = false;
            }
        }
    }
}

import java.util.Scanner;

public class Main {

    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);

        while (true) {
            int x = sc.nextInt();
            int h = sc.nextInt();

            if (x == 0 && h == 0) {
                break;
            }

            double baseArea = x * x;

            double slantHeight = Math.sqrt(h * h + (x / 2.0) * (x / 2.0));

            double triangleArea = 0.5 * x * slantHeight;

            double totalSurfaceArea = baseArea + 4 * triangleArea;

            System.out.printf("%.6f\n", totalSurfaceArea);
        }

        sc.close();
    }
}

