import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        long[] dp = new long[31];
        dp[0] = 1;
        dp[1] = 1;
        dp[2] = 2;
        for (int i = 3; i <= 30; i++) {
            dp[i] = dp[i - 1] + dp[i - 2] + dp[i - 3];
        }

        while (true) {
            int n = sc.nextInt();
            if (n == 0) {
                break;
            }

            long totalWays = dp[n];
            long daysNeeded = (totalWays + 9) / 10;
            long yearsNeeded = (daysNeeded + 364) / 365;

            System.out.println(yearsNeeded);
        }
        sc.close();
    }
}

import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        long[] dp = new long[31];
        dp[0] = 1;
        dp[1] = 1;
        dp[2] = 2;
        for (int i = 3; i <= 30; i++) {
            dp[i] = dp[i - 1] + dp[i - 2] + dp[i - 3];
        }

        while (true) {
            int n = sc.nextInt();
            if (n == 0) {
                break;
            }

            long totalWays = dp[n];
            long daysNeeded = (totalWays + 9) / 10;
            long yearsNeeded = (daysNeeded + 364) / 365;

            System.out.println(yearsNeeded);
        }
        sc.close();
    }
}

import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        long[] dp = new long[31];
        dp[0] = 1;
        dp[1] = 1;
        dp[2] = 2;
        for (int i = 3; i <= 30; i++) {
            dp[i] = dp[i - 1] + dp[i - 2] + dp[i - 3];
        }

        while (true) {
            int n = sc.nextInt();
            if (n == 0) {
                break;
            }

            long totalWays = dp[n];
            long totalDays = (totalWays + 9) / 10;
            long years = (totalDays + 364) / 365;

            System.out.println(years);
        }
        sc.close();
    }
}

