            int n = sc.nextInt();
            if (n == 0) {
                break;
            }

            int[] ageGroups = new int[7];

            for (int i = 0; i < n; i++) {
                int age = sc.nextInt();
                if (age >= 0 && age <= 9) {
                    ageGroups[0]++;
                } else if (age >= 10 && age <= 19) {
                    ageGroups[1]++;
                } else if (age >= 20 && age <= 29) {
                    ageGroups[2]++;
                } else if (age >= 30 && age <= 39) {
                    ageGroups[3]++;
                } else if (age >= 40 && age <= 49) {
                    ageGroups[4]++;
                } else if (age >= 50 && age <= 59) {
                    ageGroups[5]++;
                } else if (age >= 60) {
                    ageGroups[6]++;
                }
            }

            for (int count : ageGroups) {
                System.out.println(count);
            }
        }
        sc.close();
    }
}

