public class Main {

    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);

        while (true) {
            long a = sc.nextLong();
            long b = sc.nextLong();

            if (a == 0 && b == 0) {
                break;
            }

            long originalA = a;
            long originalB = b;
            int steps = 0;

            while (b != 0) {
                long temp = b;
                b = a % b;
                a = temp;
                steps++;
            }
            System.out.println(a + " " + steps);
        }
        sc.close();
    }
}

