import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);

        while (true) {
            int L = sc.nextInt();
            if (L == 0) {
                break;
            }

            int totalSavings = 0;
            int months = 0;
            boolean reachedGoal = false;

            for (int i = 0; i < 12; i++) {
                int M = sc.nextInt();
                int N = sc.nextInt();
                totalSavings += (M - N);
                months++;

                if (totalSavings >= L && !reachedGoal) {
                    System.out.println(months);
                    reachedGoal = true;
                }
            }

            if (!reachedGoal) {
                System.out.println("NA");
            }
        }

        sc.close();
    }
}

