import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);

        while (true) {
            int n = sc.nextInt();
            if (n == 0) {
                break;
            }

            for (int i = 0; i < n; i++) {
                int pm = sc.nextInt();
                int pe = sc.nextInt();
                int pj = sc.nextInt();

                char studentClass = 'C';

                if (pm == 100 || pe == 100 || pj == 100) {
                    studentClass = 'A';
                } else if ((pm + pe) / 2 >= 90) {
                    studentClass = 'A';
                } else if ((pm + pe + pj) / 3 >= 80) {
                    studentClass = 'A';
                }
                else if ((pm + pe + pj) / 3 >= 70) {
                    studentClass = 'B';
                } else if ((pm + pe + pj) / 3 >= 50 && (pm >= 80 || pe >= 80)) {
                    studentClass = 'B';
                }

                System.out.println(studentClass);
            }
        }

        sc.close();
    }
}

