public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);

        while (true) {
            int N = sc.nextInt();
            int M = sc.nextInt();
            int P = sc.nextInt();

            if (N == 0 && M == 0 && P == 0) {
                break;
            }

            int[] X = new int[N];
            int totalVotes = 0;
            for (int i = 0; i < N; i++) {
                X[i] = sc.nextInt();
                totalVotes += X[i];
            }

            long totalPrizePool = (long) totalVotes * 100 * (100 - P) / 100;

            if (X[M - 1] == 0) {
                System.out.println(0);
            } else {
                System.out.println(totalPrizePool / X[M - 1]);
            }
        }

        sc.close();
    }
}

