import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int t = sc.nextInt();
        while (t-- > 0) {
            int n = sc.nextInt();
            int[] h = new int[n];
            for (int i = 0; i < n; i++) {
                h[i] = sc.nextInt();
            }

            int maxUp = 0;
            int maxDown = 0;

            for (int i = 0; i < n - 1; i++) {
                int diff = h[i + 1] - h[i];
                if (diff > 0) {
                    maxUp = Math.max(maxUp, diff);
                } else {
                    maxDown = Math.max(maxDown, -diff);
                }
            }
            System.out.println(maxUp + " " + maxDown);
        }
        sc.close();
    }
}

