import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        while (true) {
            int n = sc.nextInt();
            if (n == 0) {
                break;
            }

            int count = 0;
            for (int k = 2; k * (k + 1) / 2 <= n; k++) {
                int numerator = n - k * (k - 1) / 2;
                if (numerator > 0 && numerator % k == 0) {
                    count++;
                }
            }
            System.out.println(count);
        }
        sc.close();
    }
}

