import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);

        int[][][] buildings = new int[4][3][10];

        int n = sc.nextInt();

        for (int i = 0; i < n; i++) {
            int b = sc.nextInt();
            int f = sc.nextInt();
            int r = sc.nextInt();
            int v = sc.nextInt();
            buildings[b - 1][f - 1][r - 1] += v;
        }

        for (int b = 0; b < 4; b++) {
            for (int f = 0; f < 3; f++) {
                for (int r = 0; r < 10; r++) {
                    System.out.print(" " + buildings[b][f][r]);
                }
                System.out.println();
            }
            if (b < 3) {
                System.out.println("####################");
            }
        }

        sc.close();
    }
}

