import java.util.Scanner;

public class Main {

  public static void main(String[] args) {
    Scanner sc = new Scanner(System.in);

    while (true) {
      String x = sc.next();
      if (x.equals("0")) {
        break;
      }

      int sum = 0;
      for (char c : x.toCharArray()) {
        sum += Character.getNumericValue(c);
      }
      System.out.println(sum);
    }

    sc.close();
  }
}

