import java.io.BufferedReader;
import java.io.IOException;
import java.io.InputStreamReader;
import java.util.ArrayDeque;
import java.util.Queue;

public class Main {
    public static void main(String[] args) throws IOException {
        BufferedReader br = new BufferedReader(new InputStreamReader(System.in));
        String[] line = br.readLine().split(" ");
        int n = Integer.parseInt(line[0]);
        int q = Integer.parseInt(line[1]);

        Queue[] queues = new ArrayDeque[n];
        for (int i = 0; i < n; i++) {
            queues[i] = new ArrayDeque<>();
        }

        for (int i = 0; i < q; i++) {
            String[] query = br.readLine().split(" ");
            int command = Integer.parseInt(query[0]);
            int t = Integer.parseInt(query[1]);

            switch (command) {
                case 0:
                    int x = Integer.parseInt(query[2]);
                    queues[t].add(x);
                    break;
                case 1:
                    if (!queues[t].isEmpty()) {
                        System.out.println(queues[t].peek());
                    }
                    break;
                case 2:
                    if (!queues[t].isEmpty()) {
                        queues[t].poll();
                    }
                    break;
            }
        }
    }
}

import java.io.BufferedReader;
import java.io.IOException;
import java.io.InputStreamReader;
import java.util.ArrayDeque;
import java.util.Queue;

public class Main {

  public static void main(String[] args) throws IOException {
    BufferedReader br = new BufferedReader(new InputStreamReader(System.in));
    String[] line1 = br.readLine().split(" ");
    int n = Integer.parseInt(line1[0]);
    int q = Integer.parseInt(line1[1]);

    Queue[] queues = new ArrayDeque[n];
    for (int i = 0; i < n; i++) {
      queues[i] = new ArrayDeque<>();
    }

    for (int i = 0; i < q; i++) {
      String[] query = br.readLine().split(" ");
      int type = Integer.parseInt(query[0]);
      int t = Integer.parseInt(query[1]);

      switch (type) {
        case 0:
          int x = Integer.parseInt(query[2]);
          queues[t].offer(x);
          break;
        case 1:
          if (!queues[t].isEmpty()) {
            System.out.println(queues[t].peek());
          }
          break;
        case 2:
          if (!queues[t].isEmpty()) {
            queues[t].poll();
          }
          break;
      }
    }
  }
}

