import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        long m = sc.nextLong();
        long n = sc.nextLong();
        long M = 1000000007;

        long result = 1;
        m %= M;

        while (n > 0) {
            if (n % 2 == 1) {
                result = (result * m) % M;
            }
            m = (m * m) % M;
            n /= 2;
        }

        System.out.println(result);
        sc.close();
    }
}

