import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int D = sc.nextInt();
        int[] c = new int[27];
        for (int i = 1; i <= 26; i++) {
            c[i] = sc.nextInt();
        }
        int[][] s = new int[D + 1][27];
        for (int i = 1; i <= D; i++) {
            for (int j = 1; j <= 26; j++) {
                s[i][j] = sc.nextInt();
            }
        }
        int[] t = new int[D + 1];
        for (int i = 1; i <= D; i++) {
            t[i] = sc.nextInt();
        }

        long totalSatisfaction = 0;
        int[] lastContestDay = new int[27];

        for (int d = 1; d <= D; d++) {
            int contestType = t[d];
            totalSatisfaction += s[d][contestType];
            lastContestDay[contestType] = d;

            for (int i = 1; i <= 26; i++) {
                totalSatisfaction -= c[i] * (d - lastContestDay[i]);
            }
            System.out.println(totalSatisfaction);
        }
        sc.close();
    }
}

