import java.util.*;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int X = sc.nextInt();
        int Y = sc.nextInt();
        int A = sc.nextInt();
        int B = sc.nextInt();
        int C = sc.nextInt();

        Integer[] p = new Integer[A];
        for (int i = 0; i < A; i++) {
            p[i] = sc.nextInt();
        }
        Integer[] q = new Integer[B];
        for (int i = 0; i < B; i++) {
            q[i] = sc.nextInt();
        }
        Integer[] r = new Integer[C];
        for (int i = 0; i < C; i++) {
            r[i] = sc.nextInt();
        }

        Arrays.sort(p, Collections.reverseOrder());
        Arrays.sort(q, Collections.reverseOrder());
        Arrays.sort(r, Collections.reverseOrder());

        List eatenApples = new ArrayList<>();
        for (int i = 0; i < X; i++) {
            eatenApples.add(p[i]);
        }
        for (int i = 0; i < Y; i++) {
            eatenApples.add(q[i]);
        }

        for (int val : r) {
            eatenApples.add(val);
        }

        Collections.sort(eatenApples, Collections.reverseOrder());

        long totalDeliciousness = 0;
        for (int i = 0; i < X + Y; i++) {
            totalDeliciousness += eatenApples.get(i);
        }

        System.out.println(totalDeliciousness);

        sc.close();
    }
}

