import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int N = sc.nextInt();
        int[] H = new int[N];
        for (int i = 0; i < N; i++) {
            H[i] = sc.nextInt();
        }
        sc.close();

        int maxMoves = 0;
        int currentMoves = 0;

        for (int i = 0; i < N - 1; i++) {
            if (H[i] >= H[i + 1]) {
                currentMoves++;
            } else {
                maxMoves = Math.max(maxMoves, currentMoves);
                currentMoves = 0;
            }
        }
        maxMoves = Math.max(maxMoves, currentMoves);

        System.out.println(maxMoves);
    }
}

