            v[i] = sc.nextDouble();
        }

        Arrays.sort(v);

        double currentValue = v[0];
        for (int i = 1; i < N; i++) {
            currentValue = (currentValue + v[i]) / 2.0;
        }

        System.out.println(currentValue);

        sc.close();
    }
}

