import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int n = sc.nextInt();
        int[] p = new int[n];
        for (int i = 0; i < n; i++) {
            p[i] = sc.nextInt();
        }
        sc.close();

        int count = 0;
        for (int i = 1; i < n - 1; i++) {
            int p_prev = p[i - 1];
            int p_curr = p[i];
            int p_next = p[i + 1];

            if ((p_curr > p_prev && p_curr < p_next) || (p_curr < p_prev && p_curr > p_next)) {
                count++;
            }
        }
        System.out.println(count);
    }
}

