import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int H = sc.nextInt();
        int W = sc.nextInt();
        char[][] S = new char[H][W];
        for (int i = 0; i < H; i++) {
            S[i] = sc.next().toCharArray();
        }

        int[][] left = new int[H][W];
        int[][] right = new int[H][W];
        int[][] up = new int[H][W];
        int[][] down = new int[H][W];

        for (int i = 0; i < H; i++) {
            for (int j = 0; j < W; j++) {
                if (S[i][j] == '.') {
                    left[i][j] = 1 + (j > 0 ? left[i][j - 1] : 0);
                }
            }
            for (int j = W - 1; j >= 0; j--) {
                if (S[i][j] == '.') {
                    right[i][j] = 1 + (j < W - 1 ? right[i][j + 1] : 0);
                }
            }
        }

        for (int j = 0; j < W; j++) {
            for (int i = 0; i < H; i++) {
                if (S[i][j] == '.') {
                    up[i][j] = 1 + (i > 0 ? up[i - 1][j] : 0);
                }
            }
            for (int i = H - 1; i >= 0; i--) {
                if (S[i][j] == '.') {
                    down[i][j] = 1 + (i < H - 1 ? down[i + 1][j] : 0);
                }
            }
        }

        int maxLighted = 0;
        for (int i = 0; i < H; i++) {
            for (int j = 0; j < W; j++) {
                if (S[i][j] == '.') {
                    int currentLighted = left[i][j] + right[i][j] + up[i][j] + down[i][j] - 3;
                    maxLighted = Math.max(maxLighted, currentLighted);
                }
            }
        }

        System.out.println(maxLighted);
        sc.close();
    }
}

