import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int N = sc.nextInt();
        int M = sc.nextInt();

        int[][] s = new int[M][];
        for (int i = 0; i < M; i++) {
            int k = sc.nextInt();
            s[i] = new int[k];
            for (int j = 0; j < k; j++) {
                s[i][j] = sc.nextInt() - 1;
            }
        }

        int[] p = new int[M];
        for (int i = 0; i < M; i++) {
            p[i] = sc.nextInt();
        }

        int count = 0;
        for (int i = 0; i < (1 << N); i++) {
            boolean allBulbsLighted = true;
            for (int j = 0; j < M; j++) {
                int onSwitchCount = 0;
                for (int switchIdx : s[j]) {
                    if (((i >> switchIdx) & 1) == 1) {
                        onSwitchCount++;
                    }
                }
                if (onSwitchCount % 2 != p[j]) {
                    allBulbsLighted = false;
                    break;
                }
            }
            if (allBulbsLighted) {
                count++;
            }
        }

        System.out.println(count);
        sc.close();
    }
}

