import java.util.Scanner;

public class Main {

    private static long xorSumUpToN(long n) {
        long remainder = n % 4;
        if (remainder == 0) {
            return n;
        } else if (remainder == 1) {
            return 1;
        } else if (remainder == 2) {
            return n + 1;
        } else {
            return 0;
        }
    }

    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        long A = sc.nextLong();
        long B = sc.nextLong();
        sc.close();

        long result = xorSumUpToN(B) ^ xorSumUpToN(A - 1);
        System.out.println(result);
    }
}

