import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int N = sc.nextInt();
        int W = sc.nextInt();

        long[] dp = new long[W + 1];

        for (int i = 0; i < N; i++) {
            int w = sc.nextInt();
            int v = sc.nextInt();
            for (int j = W; j >= w; j--) {
                dp[j] = Math.max(dp[j], dp[j - w] + v);
            }
        }

        long maxValue = 0;
        for (long val : dp) {
            maxValue = Math.max(maxValue, val);
        }

        System.out.println(maxValue);
        sc.close();
    }
}

