import java.util.Arrays;
import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int N = sc.nextInt();
        long[] B = new long[N];
        for (int i = 0; i < N; i++) {
            long A_i = sc.nextLong();
            B[i] = A_i - (i + 1);
        }

        Arrays.sort(B);

        long median;
        if (N % 2 == 1) {
            median = B[N / 2];
        } else {
            median = B[N / 2 - 1];
        }

        long minSadness = 0;
        for (int i = 0; i < N; i++) {
            minSadness += Math.abs(B[i] - median);
        }

        System.out.println(minSadness);

        sc.close();
    }
}

