import java.util.Scanner;

public class Main {

    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int N = sc.nextInt();
        char[][] S = new char[N][N];
        for (int i = 0; i < N; i++) {
            String row = sc.next();
            for (int j = 0; j < N; j++) {
                S[i][j] = row.charAt(j);
            }
        }

        int goodBoardCount = 0;

        for (int A = 0; A < N; A++) {
            for (int B = 0; B < N; B++) {
                boolean isGoodBoard = true;
                for (int i = 0; i < N; i++) {
                    for (int j = 0; j < N; j++) {
                        if (S[(i + A) % N][(j + B) % N] != S[(j + A) % N][(i + B) % N]) {
                            isGoodBoard = false;
                            break;
                        }
                    }
                    if (!isGoodBoard) {
                        break;
                    }
                }
                if (isGoodBoard) {
                    goodBoardCount++;
                }
            }
        }

        System.out.println(goodBoardCount);
        sc.close();
    }
}

