import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);

        int N = sc.nextInt();
        int M = sc.nextInt();
        int X = sc.nextInt();

        int[] A = new int[M];
        for (int i = 0; i < M; i++) {
            A[i] = sc.nextInt();
        }

        int costTo0 = 0;
        for (int i = 0; i < M; i++) {
            if (A[i] < X) {
                costTo0++;
            }
        }

        int costToN = 0;
        for (int i = 0; i < M; i++) {
            if (A[i] > X) {
                costToN++;
            }
        }

        System.out.println(Math.min(costTo0, costToN));

        sc.close();
    }
}

