import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int N = sc.nextInt();
        int K = sc.nextInt();
        long[] x = new long[N];
        long[] y = new long[N];
        for (int i = 0; i < N; i++) {
            x[i] = sc.nextLong();
            y[i] = sc.nextLong();
        }

        long minArea = Long.MAX_VALUE;

        for (int i = 0; i < N; i++) {
            for (int j = 0; j < N; j++) {
                long x1 = x[i];
                long x2 = x[j];

                for (int a = 0; a < N; a++) {
                    for (int b = 0; b < N; b++) {
                        long y1 = y[a];
                        long y2 = y[b];

                        long left = Math.min(x1, x2);
                        long right = Math.max(x1, x2);
                        long bottom = Math.min(y1, y2);
                        long top = Math.max(y1, y2);

                        int count = 0;
                        for (int p = 0; p < N; p++) {
                            if (x[p] >= left && x[p] <= right && y[p] >= bottom && y[p] <= top) {
                                count++;
                            }
                        }

                        if (count >= K) {
                            long area = (right - left) * (top - bottom);
                            minArea = Math.min(minArea, area);
                        }
                    }
                }
            }
        }
        System.out.println(minArea);
        sc.close();
    }
}

import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int N = sc.nextInt();
        int K = sc.nextInt();
        long[] x = new long[N];
        long[] y = new long[N];
        for (int i = 0; i < N; i++) {
            x[i] = sc.nextLong();
            y[i] = sc.nextLong();
        }

        long minArea = Long.MAX_VALUE;

        for (int i = 0; i < N; i++) {
            for (int j = 0; j < N; j++) {
                long x1 = x[i];
                long x2 = x[j];

                for (int m = 0; m < N; m++) {
                    for (int n = 0; n < N; n++) {
                        long y1 = y[m];
                        long y2 = y[n];

                        long minX = Math.min(x1, x2);
                        long maxX = Math.max(x1, x2);
                        long minY = Math.min(y1, y2);
                        long maxY = Math.max(y1, y2);

                        int count = 0;
                        for (int p = 0; p < N; p++) {
                            if (x[p] >= minX && x[p] <= maxX && y[p] >= minY && y[p] <= maxY) {
                                count++;
                            }
                        }

                        if (count >= K) {
                            long area = (maxX - minX) * (maxY - minY);
                            minArea = Math.min(minArea, area);
                        }
                    }
                }
            }
        }
        System.out.println(minArea);
        sc.close();
    }
}

