import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int H = sc.nextInt();
        int W = sc.nextInt();
        int N = sc.nextInt();
        int[] a = new int[N];
        for (int i = 0; i < N; i++) {
            a[i] = sc.nextInt();
        }
        sc.close();

        int[][] grid = new int[H][W];
        int colorIndex = 0;
        int count = 0;

        for (int i = 0; i < H; i++) {
            if (i % 2 == 0) {
                for (int j = 0; j < W; j++) {
                    grid[i][j] = colorIndex + 1;
                    count++;
                    if (count == a[colorIndex]) {
                        colorIndex++;
                        count = 0;
                    }
                }
            } else {
                for (int j = W - 1; j >= 0; j--) {
                    grid[i][j] = colorIndex + 1;
                    count++;
                    if (count == a[colorIndex]) {
                        colorIndex++;
                        count = 0;
                    }
                }
            }
        }

        for (int i = 0; i < H; i++) {
            for (int j = 0; j < W; j++) {
                System.out.print(grid[i][j] + (j == W - 1 ? "" : " "));
            }
            System.out.println();
        }
    }
}

