import java.util.*;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int N = sc.nextInt();

        List<List> adj = new ArrayList<>();
        for (int i = 0; i <= N; i++) {
            adj.add(new ArrayList<>());
        }
        for (int i = 0; i < N - 1; i++) {
            int u = sc.nextInt();
            int v = sc.nextInt();
            adj.get(u).add(v);
            adj.get(v).add(u);
        }

        int[] distFennec = new int[N + 1];
        Arrays.fill(distFennec, -1);
        Queue qFennec = new LinkedList<>();
        qFennec.add(1);
        distFennec[1] = 0;
        while (!qFennec.isEmpty()) {
            int u = qFennec.poll();
            for (int v : adj.get(u)) {
                if (distFennec[v] == -1) {
                    distFennec[v] = distFennec[u] + 1;
                    qFennec.add(v);
                }
            }
        }

        int[] distSnuke = new int[N + 1];
        Arrays.fill(distSnuke, -1);
        Queue qSnuke = new LinkedList<>();
        qSnuke.add(N);
        distSnuke[N] = 0;
        while (!qSnuke.isEmpty()) {
            int u = qSnuke.poll();
            for (int v : adj.get(u)) {
                if (distSnuke[v] == -1) {
                    distSnuke[v] = distSnuke[u] + 1;
                    qSnuke.add(v);
                }
            }
        }

        int fennecCount = 0;
        int snukeCount = 0;

        for (int i = 1; i <= N; i++) {
            if (distFennec[i] <= distSnuke[i]) {
                fennecCount++;
            } else {
                snukeCount++;
            }
        }

        if (fennecCount > snukeCount) {
            System.out.println("Fennec");
        } else {
            System.out.println("Snuke");
        }

        sc.close();
    }
}

import java.util.*;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int N = sc.nextInt();

        List<List> adj = new ArrayList<>();
        for (int i = 0; i <= N; i++) {
            adj.add(new ArrayList<>());
        }

        for (int i = 0; i < N - 1; i++) {
            int u = sc.nextInt();
            int v = sc.nextInt();
            adj.get(u).add(v);
            adj.get(v).add(u);
        }

        int[] distFennec = new int[N + 1];
        Arrays.fill(distFennec, -1);
        Queue qFennec = new LinkedList<>();
        qFennec.offer(1);
        distFennec[1] = 0;

        while (!qFennec.isEmpty()) {
            int u = qFennec.poll();
            for (int v : adj.get(u)) {
                if (distFennec[v] == -1) {
                    distFennec[v] = distFennec[u] + 1;
                    qFennec.offer(v);
                }
            }
        }

        int[] distSnuke = new int[N + 1];
        Arrays.fill(distSnuke, -1);
        Queue qSnuke = new LinkedList<>();
        qSnuke.offer(N);
        distSnuke[N] = 0;

        while (!qSnuke.isEmpty()) {
            int u = qSnuke.poll();
            for (int v : adj.get(u)) {
                if (distSnuke[v] == -1) {
                    distSnuke[v] = distSnuke[u] + 1;
                    qSnuke.offer(v);
                }
            }
        }

        int fennecCount = 0;
        int snukeCount = 0;

        for (int i = 1; i <= N; i++) {
            if (distFennec[i] <= distSnuke[i]) {
                fennecCount++;
            } else {
                snukeCount++;
            }
        }

        if (fennecCount > snukeCount) {
            System.out.println("Fennec");
        } else {
            System.out.println("Snuke");
