import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int n = sc.nextInt();
        int m = sc.nextInt();
        long[] x = new long[n];
        long[] y = new long[m];
        for (int i = 0; i < n; i++) {
            x[i] = sc.nextLong();
        }
        for (int i = 0; i < m; i++) {
            y[i] = sc.nextLong();
        }
        sc.close();

        long MOD = 1000000007;

        long sumWidths = 0;
        for (int i = 0; i < n; i++) {
            sumWidths = (sumWidths + (2L * i - (n - 1)) * x[i]) % MOD;
        }

        long sumHeights = 0;
        for (int i = 0; i < m; i++) {
            sumHeights = (sumHeights + (2L * i - (m - 1)) * y[i]) % MOD;
        }

        long totalArea = (sumWidths * sumHeights) % MOD;
        if (totalArea < 0) {
            totalArea += MOD;
        }

        System.out.println(totalArea);
    }
}

