public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int N = sc.nextInt();
        long T = sc.nextLong();
        long[] A = new long[N];
        for (int i = 0; i < N; i++) {
            A[i] = sc.nextLong();
        }

        long maxProfit = 0;
        long minPrice = A[0];
        for (int i = 1; i < N; i++) {
            maxProfit = Math.max(maxProfit, A[i] - minPrice);
            minPrice = Math.min(minPrice, A[i]);
        }

        long count = 0;
        minPrice = A[0];
        for (int i = 1; i < N; i++) {
            if (A[i] - minPrice == maxProfit) {
                count++;
            }
            minPrice = Math.min(minPrice, A[i]);
        }

        System.out.println(count);
        sc.close();
    }
}

