import java.util.*;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int W = sc.nextInt();
        int H = sc.nextInt();

        List edges = new ArrayList<>();

        for (int i = 0; i < W; i++) {
            long p = sc.nextLong();
            edges.add(new Edge(p, 0));
        }

        for (int i = 0; i < H; i++) {
            long q = sc.nextLong();
            edges.add(new Edge(q, 1));
        }

        Collections.sort(edges);

        long totalCost = 0;
        long pavedHorizontalRoads = 0;
        long pavedVerticalRoads = 0;

        for (Edge edge : edges) {
            if (edge.type == 0) {
                totalCost += edge.cost * (H + 1 - pavedVerticalRoads);
                pavedHorizontalRoads++;
            } else {
                totalCost += edge.cost * (W + 1 - pavedHorizontalRoads);
                pavedVerticalRoads++;
            }
        }

        System.out.println(totalCost);
        sc.close();
    }

    static class Edge implements Comparable {
        long cost;
        int type;

        public Edge(long cost, int type) {
            this.cost = cost;
            this.type = type;
        }

        @Override
        public int compareTo(Edge other) {
            return Long.compare(this.cost, other.cost);
        }
    }
}

import java.util.*;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int W = sc.nextInt();
        int H = sc.nextInt();

        List edges = new ArrayList<>();

        for (int i = 0; i < W; i++) {
            long p = sc.nextLong();
            edges.add(new Edge(p, 0));
        }

        for (int i = 0; i < H; i++) {
            long q = sc.nextLong();
            edges.add(new Edge(q, 1));
        }

        Collections.sort(edges);

        long minCost = 0;
        long horizontalPavedCount = 0;
        long verticalPavedCount = 0;

        for (Edge edge : edges) {
            if (edge.type == 0) {
                minCost += edge.cost * (H + 1 - verticalPavedCount);
                horizontalPavedCount++;
            } else {
                minCost += edge.cost * (W + 1 - horizontalPavedCount);
                verticalPavedCount++;
            }
        }

        System.out.println(minCost);
        sc.close();
    }

    static class Edge implements Comparable {
        long cost;
        int type;

        public Edge(long cost, int type) {
            this.cost = cost;
            this.type = type;
        }

        @Override
        public int compareTo(Edge other) {
            return Long.compare(this.cost, other.cost);
        }
    }
}

import java.util.HashMap;
