import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        String s = sc.next();
        sc.close();

        boolean hasN = false;
        boolean hasS = false;
        boolean hasE = false;
        boolean hasW = false;

        for (char c : s.toCharArray()) {
            if (c == 'N') {
                hasN = true;
            } else if (c == 'S') {
                hasS = true;
            } else if (c == 'E') {
                hasE = true;
            } else if (c == 'W') {
                hasW = true;
            }
        }

        if ((hasN == hasS) && (hasE == hasW)) {
            System.out.println("Yes");
        } else {
            System.out.println("No");
        }
    }
}

