import java.util.HashSet;
import java.util.Scanner;
import java.util.Set;

public class Main {

    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int N = sc.nextInt();
        int K = sc.nextInt();
        Set dislikedDigits = new HashSet<>();
        for (int i = 0; i < K; i++) {
            dislikedDigits.add(sc.nextInt());
        }

        int amount = N;
        while (true) {
            if (isValid(amount, dislikedDigits)) {
                System.out.println(amount);
                break;
            }
            amount++;
        }
        sc.close();
    }

    private static boolean isValid(int num, Set dislikedDigits) {
        if (num == 0) {
            return !dislikedDigits.contains(0);
        }
        int temp = num;
        while (temp > 0) {
            int digit = temp % 10;
            if (dislikedDigits.contains(digit)) {
                return false;
            }
            temp /= 10;
        }
        return true;
    }
}

import java.util.Scanner;
import java.util.Set;
import java.util.HashSet;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int N = sc.nextInt();
        int K = sc.nextInt();
        Set dislikedDigits = new HashSet<>();
        for (int i = 0; i < K; i++) {
            dislikedDigits.add(sc.nextInt());
        }

        int amount = N;
        while (true) {
            if (isValid(amount, dislikedDigits)) {
                System.out.println(amount);
                break;
            }
            amount++;
        }

        sc.close();
    }

    private static boolean isValid(int num, Set dislikedDigits) {
        if (num == 0) {
            return !dislikedDigits.contains(0);
        }

        int temp = num;
        while (temp > 0) {
            int digit = temp % 10;
            if (dislikedDigits.contains(digit)) {
                return false;
            }
            temp /= 10;
        }
        return true;
    }
}

import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int[] coins = {500, 100, 50, 10, 5, 1};

        while (true) {
            int amount = sc.nextInt();
            if (amount == 0) break;

            int change = 1000 - amount;
            int totalCoins = 0;

            for (int coin : coins) {
                totalCoins += change / coin;
                change %= coin;
            }

            System.out.println(totalCoins);
        }

        sc.close();
    }
}

